        WordRepository.create(context,"Windows CE 1.0","Devices of the time mainly had 480×240 pixel displays with the exception of the Hewlett-Packard \'Palmtop PC\' which had a 640×240 display. Each window took over the full display. Navigation was done by tapping or double tapping on an item. A contextual menu was also available by the user pressing the ALT key and tapping on the screen. Windows CE 1.0 did not include a cascading Start menu unlike Windows 95 and Windows NT 4.0 did. Microsoft released the Windows CE 1.0 Power Toys that included a cascading menu icon that appeared in the system tray. Also bundled were several other utilities, most notable were a sound applet for the system tray, enabling the user to quickly mute or unmute their device or adjust the volume and a \'pocket\' version of Paint.");

        WordRepository.create(context,"Android 9.0","On August 6, 2018, Google officially announced the final release of Android 9.0 under the title \"Pie\", with the update initially available for current Google Pixel devices, and releases for Android One devices and others to follow \"later this year\". The Essential Phone was the first third-party Android device to receive an update to Pie, notably coming day-and-date with its final release. The Sony Xperia XZ3 was the first device with Android Pie pre-installed.");

        WordRepository.create(context,"Intel Xeon CPU","Some shortcomings that make Xeon processors unsuitable for most consumer-grade desktop PCs include lower clock rates at the same price point (since servers run more tasks in parallel than desktops, core counts are more important than clock rates), usually an absence of an integrated GPU, and lack of support for overclocking. Despite such disadvantages, Xeon processors have always had popularity among desktop users (primarily gamers, and extreme users), mainly due to higher core count potential, and higher performance to price ratio vs. the Core i7 in terms of total computing power of all cores. Since most Intel Xeon CPUs lack an integrated GPU, systems built with those processors require a discrete graphics card or a separate GPU if computer monitor output is desired.");

        WordRepository.create(context,"Ubuntu 12.04","Ubuntu 12.04 LTS (Precise Pangolin) is Canonical\'s sixteenth release of Ubuntu and its fourth Long Term Support (LTS) release, made available on schedule on 26 April 2012. It is named after the pangolin anteater. Previous LTS releases have been supported for three years for the desktop version and five years for the server version; this release was supported for five years for both versions, with support ending on 28 April 2017. Canonical continues to offer extended security maintenance to Advantage customers for an additional two years.");

