        WordRepository.create(context,"IBM PC","The IBM Personal Computer, commonly known as the IBM PC, is the original version and progenitor of the IBM PC compatible hardware platform. It is IBM model number 5150, and was introduced on August 12, 1981. It was created by a team of engineers and designers under the direction of Don Estridge of the IBM Entry Systems Division in Boca Raton, Florida.");

        WordRepository.create(context,"Ubuntu 12.10","On 23 April 2012 Shuttleworth announced that Ubuntu 12.10 would be named Quantal Quetzal. As this will be the first of a series of three releases before the next LTS release, Shuttleworth indicated that it will include a refreshed look, with work to be done on typography and iconography. The release takes its name from the quetzal, a species of Central American birds. Ubuntu 12.10 was released on schedule on 18 October 2012 and is Canonical\'s seventeenth release of the operating system.");

        WordRepository.create(context,"Windows 10 Anniversary Update","The Windows 10 Anniversary Update (also known as version 1607 and codenamed \"Redstone 1\") is the second major update to Windows 10 and the first in a series of updates under the Redstone codenames. It carries the build number 10.0.14393. The first preview was released on December 16, 2015. The final release was made available to Windows Insiders on July 18, 2016, followed by a public release on August 2. This release of Windows 10 is supported for users of the Current Branch (CB), Current Branch for Business (CBB) and Long-Term Support Branch (LTSB).");

        WordRepository.create(context,"Apple Network Server 500","As an alternative to AIX it is possible, though complicated, to install PowerPC Linux or NetBSD on the ANS. It is possible, with prototype Macintosh ROMs, to boot an Apple Network Server 500 or 700 into Mac OS 7.5 or later, however Ethernet support was not complete. No reliable sources for the procedure or requirements exist. Not only is the Ethernet different, but the display interface is as well. Using an Apple-branded, but DEC \"Tulip\" Ethernet card  and a display card from a 9500 goes a long way towards achieving Mac OS capability but even this is not assured.[clarification needed] Yellowdog Linux 2.x or 3.x is more assured, and NetBSD 1.5.x might be even better. Major issues remain, such as the dual \"Bandit\" bus controllers, the proprietary floppy format, and possibly the CD-ROM. UW-SCSI hard disks are seldom an issue and Apple even released an U-SCSI (but narrow) hard disk installation kit for the ANS even though an ANS is normally only equipped with UW-SCSI disks.");

