        WordRepository.create(context,"Bresenham\'s algorithm","Bresenham\'s algorithm was later extended to produce circles, the resulting algorithms being \'Bresenham\'s circle algorithm and midpoint circle algorithm.[citation needed]");

        WordRepository.create(context,"BSP tree","In computer science, binary space partitioning (BSP) is a method for recursively subdividing a space into two convex sets by using hyperplanes as partitions. This process of subdividing gives rise to a representation of objects within the space in the form of a tree data structure known as a BSP tree.");

        WordRepository.create(context,"Byzantine generals","A Byzantine fault (also interactive consistency, source congruency, error avalanche, Byzantine agreement problem, Byzantine generals problem, and Byzantine failure) is a condition of a computer system, particularly distributed computing systems, where components may fail and there is imperfect information on whether a component has failed. The term takes its name from an allegory, the \"Byzantine Generals Problem\", developed to describe this condition, where actors must agree on a concerted strategy to avoid catastrophic system failure, but some of the actors are unreliable.");

        WordRepository.create(context,"C curve","In mathematics, the Lévy C curve is a self-similar fractal that was first described and whose differentiability properties were analysed by Ernesto Cesàro in 1906 and Georg Faber in 1910, but now bears the name of French mathematician Paul Lévy, who was the first to describe its self-similarity properties, as well as to provide a geometrical construction showing it as a representative curve in the same class as the Koch curve. It is a special case of a period-doubling curve, a de Rham curve.");

        WordRepository.create(context,"Chinese postman problem","In graph theory, a branch of mathematics and computer science, the Chinese postman problem (CPP), postman tour or route inspection problem is to find a shortest closed path or circuit that visits every edge of an (connected) undirected graph. When the graph has an Eulerian circuit (a closed walk that covers every edge once), that circuit is an optimal solution. Otherwise, the optimization problem is to find the smallest number of graph edges to duplicate (or the subset of edges with the minimum possible total weight) so that the resulting multigraph does have an Eulerian circuit. It may be solved in polynomial time.");

        WordRepository.create(context,"Cook reduction","In computability theory, a Turing reduction (also known as a Cook reduction) from a problem A to a problem B, is a reduction which solves A, assuming the solution to B is already known (Rogers 1967, Soare 1987). It can be understood as an algorithm that could be used to solve A if it had available to it a subroutine for solving B. More formally, a Turing reduction is a function computable by an oracle machine with an oracle for B. Turing reductions can be applied to both decision problems and function problems.");

        WordRepository.create(context,"Cook\'s theorem","In computational complexity theory, the Cook–Levin theorem, also known as Cook\'s theorem, states that the Boolean satisfiability problem is NP-complete. That is, any problem in NP can be reduced in polynomial time by a deterministic Turing machine to the problem of determining whether a Boolean formula is satisfiable.");

        WordRepository.create(context,"CRCW","These kinds of algorithms are useful for understanding the exploitation of concurrency, dividing the original problem into similar sub-problems and solving them in parallel. The introduction of the formal \'P-RAM\' model in Wyllie\'s 1979 thesis had the aim of quantifying analysis of parallel algorithms in a way analogous to the Turing Machine. The analysis focused on a MIMD model of programming using a CREW model but showed that many variants, including implementing a CRCW model and implementing on an SIMD machine, were possible with only constant overhead.");

        WordRepository.create(context,"Deque","Deque is sometimes written dequeue, but this use is generally deprecated in technical literature or technical writing because dequeue is also a verb meaning \"to remove from a queue\". Nevertheless, several libraries and some writers, such as Aho, Hopcroft, and Ullman in their textbook Data Structures and Algorithms, spell it dequeue. John Mitchell, author of Concepts in Programming Languages, also uses this terminology.");

        WordRepository.create(context,"DFTA","A tree automaton is called deterministic (abbreviated DFTA) if no two rules from Δ have the same left hand side; otherwise it is called nondeterministic (NFTA). Non-deterministic top-down tree automata have the same expressive power as non-deterministic bottom-up ones; the transition rules are simply reversed, and the final states become the initial states.");

        WordRepository.create(context,"Diagonalization argument","The diagonal argument was not Cantor\'s first proof of the uncountability of the real numbers, which appeared in 1874. However, it demonstrates a general technique that has since been used in a wide range of proofs, including the first of Gödel\'s incompleteness theorems and Turing\'s answer to the Entscheidungsproblem. Diagonalization arguments are often also the source of contradictions like Russell\'s paradox and Richard\'s paradox.:27");

        WordRepository.create(context,"Disjunction","Disjunction is often used for bitwise operations. Examples:");

        WordRepository.create(context,"Distribution sort","Distribution sort refers to any sorting algorithm where data is distributed from their input to multiple intermediate structures which are then gathered and placed on the output. For example, both bucket sort and flashsort are distribution based sorting algorithms. Distribution sorting algorithms can be used on a single processor, or they can be a distributed algorithm, where individual subsets are separately sorted on different processors, then combined. This allows external sorting of data too large to fit into a single computer\'s memory.");

        WordRepository.create(context,"Don\'t care","Don\'t-care terms are important to consider in minimizing logic circuit design, using Karnaugh maps and the Quine–McCluskey algorithm. Don\'t care optimization can also be used in the development of highly size-optimized assembly or machine code taking advantage of side effects.[citation needed]");

        WordRepository.create(context,"Euclidean Steiner tree","Steiner tree problem, or minimum Steiner tree problem, named after Jakob Steiner, is an umbrella term for a class of problems in combinatorial optimization. While Steiner tree problems may be formulated in a number of settings, they all require an optimal interconnect for a given set of objects and a predefined objective function. One well-known variant, which is often used synonymously with the term Steiner tree problem, is the Steiner tree problem in graphs. Given an undirected graph with non-negative edge weights and a subset of vertices, usually referred to as terminals, the Steiner tree problem in graphs requires a tree of minimum weight that contains all terminals (but may include additional vertices). Further well-known variants are the Euclidean Steiner tree problem and the rectilinear minimum Steiner tree problem.");

        WordRepository.create(context,"Euclid\'s algorithm","In mathematics, the Euclidean algorithm,[note 1] or Euclid\'s algorithm, is an efficient method for computing the greatest common divisor (GCD) of two numbers, the largest number that divides both of them without leaving a remainder. It is named after the ancient Greek mathematician Euclid, who first described it in his Elements (c. 300 BC). It is an example of an algorithm, a step-by-step procedure for performing a calculation according to well-defined rules, and is one of the oldest algorithms in common use. It can be used to reduce fractions to their simplest form, and is a part of many other number-theoretic and cryptographic calculations.");

        WordRepository.create(context,"Euler cycle","Hierholzer\'s 1873 paper provides a different method for finding Euler cycles that is more efficient than Fleury\'s algorithm:");

        WordRepository.create(context,"Eulerian graph","The term Eulerian graph has two common meanings in graph theory. One meaning is a graph with an Eulerian circuit, and the other is a graph with every vertex of even degree. These definitions coincide for connected graphs.");

        WordRepository.create(context,"Flow function","There are various notions of a flow function that can be defined in a flow graph. Flow functions model the net flow of units between pairs of nodes, and are useful when asking questions such as what is the maximum number of units that can be transferred from the source node s to the sink node t? The simplest example of a flow function is known as a pseudo-flow.");

        WordRepository.create(context,"Greedy heuristic","Greedy algorithms have a long history of study in combinatorial optimization and theoretical computer science. Greedy heuristics are known to produce suboptimal results on many problems, and so natural questions are:");

        WordRepository.create(context,"Hamiltonian cycle","In the mathematical field of graph theory, a Hamiltonian path (or traceable path) is a path in an undirected or directed graph that visits each vertex exactly once. A Hamiltonian cycle (or Hamiltonian circuit) is a Hamiltonian path that is a cycle. Determining whether such paths and cycles exist in graphs is the Hamiltonian path problem, which is NP-complete.");

        WordRepository.create(context,"In-order traversal","In-order traversal is very commonly used on binary search trees because it returns values from the underlying set in order, according to the comparator that set up the binary search tree (hence the name).");

        WordRepository.create(context,"Karp reduction","A polynomial-time many-one reduction from a problem A to a problem B (both of which are usually required to be decision problems) is a polynomial-time algorithm for transforming inputs to problem A into inputs to problem B, such that the transformed problem has the same output as the original problem. An instance x of problem A can be solved by applying this transformation to produce an instance y of problem B, giving y as the input to an algorithm for problem B, and returning its output. Polynomial-time many-one reductions may also be known as polynomial transformations or Karp reductions, named after Richard Karp. A reduction of this type is denoted by {\\displaystyle A\\leq _{m}^{P}B}  \"A or {\\displaystyle A\\leq _{p}B}  \"{\\displaystyle.");

        WordRepository.create(context,"Kraft\'s inequality","Kraft\'s inequality was published in Kraft (1949). However, Kraft\'s paper discusses only prefix codes, and attributes the analysis leading to the inequality to Raymond Redheffer. The result was independently discovered in McMillan (1956). McMillan proves the result for the general case of uniquely decodable codes, and attributes the version for prefix codes to a spoken observation in 1955 by Joseph Leo Doob.");

        WordRepository.create(context,"Laboratory for Computer Science","MIT Computer Science and Artificial Intelligence Laboratory (CSAIL) is a research institute at the Massachusetts Institute of Technology formed by the 2003 merger of the Laboratory for Computer Science and the Artificial Intelligence Laboratory. Housed within the Stata Center, CSAIL is the largest on-campus laboratory as measured by research scope and membership.");

        WordRepository.create(context,"Linear","Linearity is the property of a mathematical relationship or function which means that it can be graphically represented as a straight line. Examples are the relationship of voltage and current across a resistor (Ohm\'s law), or the mass and weight of an object. Proportionality implies linearity, but linearity does not imply proportionality.");

        WordRepository.create(context,"Local alignment","One motivation for local alignment is the difficulty of obtaining correct alignments in regions of low similarity between distantly related biological sequences, because mutations have added too much \'noise\' over evolutionary time to allow for a meaningful comparison of those regions. Local alignment avoids such regions altogether and focuses on those with a positive score, i.e. those with an evolutionarily conserved signal of similarity. A prerequisite for local alignment is a negative expectation score. The expectation score is defined as the average score that the scoring system (substitution matrix and gap penalties) would yield for a random sequence.");

        WordRepository.create(context,"Manhattan distance","A taxicab geometry is a form of geometry in which the usual distance function or metric of Euclidean geometry is replaced by a new metric in which the distance between two points is the sum of the absolute differences of their Cartesian coordinates. The taxicab metric is also known as rectilinear distance, L1 distance, L1 distance or {\\displaystyle \\ell _{1}}  \"\\ell norm (see Lp space), snake distance, city block distance, Manhattan distance or Manhattan length, with corresponding variations in the name of the geometry. The latter names allude to the grid layout of most streets on the island of Manhattan, which causes the shortest path a car could take between two intersections in the borough to have length equal to the intersections\' distance in taxicab geometry.");

        WordRepository.create(context,"NIST","The National Institute of Standards and Technology (NIST) is a physical sciences laboratory, and a non-regulatory agency of the United States Department of Commerce. Its mission is to promote innovation and industrial competitiveness. NIST\'s activities are organized into laboratory programs that include nanoscale science and technology, engineering, information technology, neutron research, material measurement, and physical measurement.");

        WordRepository.create(context,"Oriented graph","Oriented graphs are in one-to-one correspondence with complete directed graphs (graphs in which there is a directed edge in one or both directions between every pair of distinct vertices). A complete directed graph can be converted to an oriented graph by removing every 2-cycle, and conversely an oriented graph can be converted to a complete directed graph by adding a 2-cycle between every pair of vertices that are not endpoints of an edge; these correspondences are bijective. Therefore, the same sequence of numbers also solves the graph enumeration problem for complete digraphs. There is an explicit but complicated formula for the numbers in this sequence.");

        WordRepository.create(context,"Partial order","In mathematics, especially order theory, a partially ordered set (also poset) formalizes and generalizes the intuitive concept of an ordering, sequencing, or arrangement of the elements of a set. A poset consists of a set together with a binary relation indicating that, for certain pairs of elements in the set, one of the elements precedes the other in the ordering. The word \"partial\" in the names \"partial order\" or \"partially ordered set\" is used as an indication that not every pair of elements needs to be comparable. That is, there may be pairs of elements for which neither element precedes the other in the poset. Partial orders thus generalize total orders, in which every pair is comparable.");

        WordRepository.create(context,"PATRICIA tree","Donald R. Morrison first described what he called \"Patricia trees\" in 1968; the name comes from the acronym PATRICIA, which stands for \"Practical Algorithm To Retrieve Information Coded In Alphanumeric\". Gernot Gwehenberger independently invented and described the data structure at about the same time. PATRICIA trees are radix trees with radix equals 2, which means that each bit of the key is compared individually and each node is a two-way (i.e., left versus right) branch.");

        WordRepository.create(context,"Poset","Posets are equivalent to one another if and only if they are isomorphic. In a poset, the smallest element, if it exists, is an initial object, and the largest element, if it exists, is a terminal object. Also, every preordered set is equivalent to a poset. Finally, every subcategory of a poset is isomorphism-closed.");

        WordRepository.create(context,"Postman\'s sort","The Postman\'s sort is a variant of bucket sort that takes advantage of a hierarchical structure of elements, typically described by a set of attributes. This is the algorithm used by letter-sorting machines in post offices: mail is sorted first between domestic and international; then by state, province or territory; then by destination post office; then by routes, etc. Since keys are not compared against each other, sorting time is O(cn), where c depends on the size of the key and number of buckets. This is similar to a radix sort that works \"top down,\" or \"most significant digit first.\"");

        WordRepository.create(context,"Process algebra","Process algebra has been studied for discrete time and continuous time (real time or dense time).");

        WordRepository.create(context,"Random sampling","Random sampling can also be accelerated by sampling from the distribution of gaps between samples, and skipping over the gaps.");

        WordRepository.create(context,"Recursive data structure","An important application of recursion in computer science is in defining dynamic data structures such as Lists and Trees. Recursive data structures can dynamically grow to an arbitrarily large size in response to runtime requirements; in contrast, a static array\'s size requirements must be set at compile time.");

        WordRepository.create(context,"Rice\'s method","In mathematics, the Nørlund–Rice integral, sometimes called Rice\'s method, relates the nth forward difference of a function to a line integral on the complex plane. As such, it commonly appears in the theory of finite differences, and also has been applied in computer science and graph theory to estimate binary tree lengths. It is named in honour of Niels Erik Nørlund and Stephen O. Rice. Nørlund\'s contribution was to define the integral; Rice\'s contribution was to demonstrate its utility by applying saddle-point techniques to its evaluation.");

        WordRepository.create(context,"Right rotation","Right rotation of node Q:");

        WordRepository.create(context,"Rooted tree","A rooted tree is a tree in which one vertex has been designated the root. The edges of a rooted tree can be assigned a natural orientation, either away from or towards the root, in which case the structure becomes a directed rooted tree. When a directed rooted tree has an orientation away from the root, it is called an arborescence or out-tree; when it has an orientation towards the root, it is called an anti-arborescence or in-tree. The tree-order is the partial ordering on the vertices of a tree with u < v if and only if the unique path from the root to v passes through u. A rooted tree which is a subgraph of some graph G is a normal tree if the ends of every edge in G are comparable in this tree-order whenever those ends are vertices of the tree (Diestel 2005, p. 15). Rooted trees, often with additional structure such as ordering of the neighbors at each vertex, are a key data structure in computer science; see tree data structure.");


        WordRepository.create(context,"Shuffle","Also known as the \"Indian\", \"Kattar\", \"Kenchi\" or \"Kutti Shuffle\" (Hindi for scissor). The deck is held face down, with the middle finger on one long edge and the thumb on the other on the bottom half of the deck. The other hand draws off a packet from the top of the deck. This packet is allowed to drop into the palm. The maneuver is repeated over and over, with newly drawn packets dropping onto previous ones, until the deck is all in the second hand. Indian shuffle differs from stripping in that all the action is in the hand taking the cards, whereas in stripping, the action is performed by the hand with the original deck, giving the cards to the resulting pile. This is the most common shuffling technique in Asia and other parts of the world, while the overhand shuffle is primarily used in Western countries.");

        WordRepository.create(context,"Simon\'s algorithm","The problem is set in the model of decision tree complexity or query complexity and was conceived by Daniel Simon in 1994. Simon exhibited a quantum algorithm, usually called Simon\'s algorithm, that solves the problem exponentially faster than any deterministic or probabilistic classical algorithm, requiring exponentially less computation time (or more precisely, queries) than the best classical probabilistic algorithm.");

        WordRepository.create(context,"Singly linked list","Singly linked lists contain nodes which have a data field as well as \'next\' field, which points to the next node in line of nodes. Operations that can be performed on singly linked lists include insertion, deletion and traversal.");

        WordRepository.create(context,"Space-constructible function","Space-constructible functions are used similarly, for example in the space hierarchy theorem.");

        WordRepository.create(context,"Steiner ratio","The Steiner ratio is the supremum of the ratio of the total length of the minimum spanning tree to the minimum Steiner tree for a set of points in the Euclidean plane.");

        WordRepository.create(context,"Stirling\'s formula","In mathematics, Stirling\'s approximation (or Stirling\'s formula) is an approximation for factorials. It is a good approximation, leading to accurate results even for small values of n. It is named after James Stirling, though it was first stated by Abraham de Moivre.");

        WordRepository.create(context,"Time-constructible function","Time-constructible functions are used in complexity theory results such as the time hierarchy theorem. They are important because the time hierarchy theorem relies on Turing machines that must determine in O(f(n)) time whether an algorithm has taken more than f(n) steps. This is, of course, impossible without being able to calculate f(n) in that time. Such results are typically true for all natural functions f but not necessarily true for artificially constructed f. To formulate them precisely, it is necessary to have a precise definition for a natural function f for which the theorem is true. Time-constructible functions are often used to provide such a definition.");

        WordRepository.create(context,"Total function","Total function is a synonym for function. The use of the adjective \"total\" is to suggest that it is a special case of a partial function (specifically, a total function with domain X is a special case of a partial function over X). The adjective will typically be used for clarity in contexts where partial functions are common, for example in computability theory.");

        WordRepository.create(context,"Tractable problem","Tractable problems are frequently identified with problems that have polynomial-time solutions (P, PTIME); this is known as the Cobham–Edmonds thesis. Problems that are known to be intractable in this sense include those that are EXPTIME-hard. If NP is not the same as P, then NP-hard problems are also intractable in this sense.");

        WordRepository.create(context,"Two-dimensional","Two-dimensional space (also known as bi-dimensional space) is a geometric setting in which two values (called parameters) are required to determine the position of an element (i.e., point). In mathematics, it is commonly represented by the symbol ℝ2. For a generalization of the concept, see dimension.");

        WordRepository.create(context,"2-3 tree","In computer science, a 2–3 tree is a tree data structure, where every node with children (internal node) has either two children (2-node) and one data element or three children (3-nodes) and two data elements. According to Knuth, \"a B-tree of order 3 is a 2-3 tree.\" Nodes on the outside of the tree (leaf nodes) have no children and one or two data elements. 2−3 trees were invented by John Hopcroft in 1970.");

        WordRepository.create(context,"Veitch diagram","The Karnaugh map (KM or K-map) is a method of simplifying Boolean algebra expressions. Maurice Karnaugh introduced it in 1953 as a refinement of Edward Veitch\'s 1952 Veitch chart, which actually was a rediscovery of Allan Marquand\'s 1881 logical diagram aka Marquand diagram but with a focus now set on its utility for switching circuits. Veitch charts are therefore also known as Marquand–Veitch diagrams, and Karnaugh maps as Karnaugh–Veitch maps (KV maps).");

        WordRepository.create(context,"Vertex coloring","Vertex coloring is the starting point of graph coloring. Other coloring problems can be transformed into a vertex version. For example, an edge coloring of a graph is just a vertex coloring of its line graph, and a face coloring of a plane graph is just a vertex coloring of its dual. However, non-vertex coloring problems are often stated and studied as is. That is partly for perspective, and partly because some problems are best studied in non-vertex form, as for instance is edge coloring.");

        WordRepository.create(context,"VP tree","A vantage-point tree (or VP tree) is a metric tree that segregates data in a metric space by choosing a position in the space (the \"vantage point\") and partitioning the data points into two parts: those points that are nearer to the vantage point than a threshold, and those points that are not. By recursively applying this procedure to partition the data into smaller and smaller sets, a tree data structure is created where neighbors in the tree are likely to be neighbors in the space.");

        WordRepository.create(context,"Worst case","In computer science, best, worst, and average cases of a given algorithm express what the resource usage is at least, at most and on average, respectively. Usually the resource being considered is running time, i.e. time complexity, but it could also be memory or other resource. Best case is the function which performs the minimum number of steps on input data of n elements. Worst case is the function which performs the maximum number of steps on input data of size n. Average case is the function which performs an average number of steps on input data of n elements.");

        WordRepository.create(context,"0/1 knapsack problem","A similar dynamic programming solution for the 0/1 knapsack problem also runs in pseudo-polynomial time. Assume {\\displaystyle w_{1},\\,w_{2},\\,\\ldots ,\\,w_{n},\\,W}  \"w_{1},\\,w_{2},\\,\\ldots are strictly positive integers. Define {\\displaystyle m[i,w]}  \"m[i,w]\"/ to be the maximum value that can be attained with weight less than or equal to {\\displaystyle w}  \"w\"/ using items up to {\\displaystyle i}  \"i\"/ (first {\\displaystyle i}  \"i\"/ items).");

        WordRepository.create(context,"Zipfian distribution","Zipf\'s law (/zɪf/) is an empirical law formulated using mathematical statistics that refers to the fact that many types of data studied in the physical and social sciences can be approximated with a Zipfian distribution, one of a family of related discrete power law probability distributions. Zipf distribution is related to the zeta distribution, but is not identical.");

        WordRepository.create(context,"AMD","Advanced Micro Devices, Inc. (AMD) is an American multinational semiconductor company based in Santa Clara, California and Austin, Texas that develops computer processors and related technologies for business and consumer markets. While initially it manufactured its own processors, the company later outsourced its manufacturing, a practice known as fabless, after GlobalFoundries was spun off in 2009. AMD\'s main products include microprocessors, motherboard chipsets, embedded processors and graphics processors for servers, workstations and personal computers, and embedded systems applications.");

        WordRepository.create(context,"API","In computer programming, an application programming interface (API) is a set of subroutine definitions, communication protocols, and tools for building software. In general terms, it is a set of clearly defined methods of communication among various components. A good API makes it easier to develop a computer program by providing all the building blocks, which are then put together by the programmer.");


        WordRepository.create(context,"Encarta Encyclopedia","When Encarta was released as part of the \"Reference Suite\" in 1998 to 2000, Microsoft bundled \"Microsoft Bookshelf\" with the other programs (Encarta Encyclopedia 98 Deluxe Edition, Encarta Desk Atlas, Encarta Virtual Globe 98, Encarta World English Dictionary, and Encarta Research Organizer).");

        WordRepository.create(context,"Explorer","Explorers of routes from Europe towards Asia, the Indian Ocean, and the Pacific Ocean, include Vasco da Gama (1460–1524), a navigator who made the first trip from Europe to India and back by the Cape of Good Hope, discovering the ocean route to the East; Pedro Alvares Cabral (c. 1467/68–c.1520) who, following the path of Gama, claimed Brazil and led the first expedition that linked Europe, Africa, America, and Asia; Diogo Dias, who discovered the eastern coast of Madagascar and rounded the corner of Africa; explorers such as Diogo Fernandes Pereira and Pedro Mascarenhas (1470–1555), among others, who discovered and mapped the Mascarene Islands and other archipelagos.");

        WordRepository.create(context,"Footnotes","Footnotes are notes at the foot of the page while endnotes are collected under a separate heading at the end of a chapter, volume, or entire work. Unlike footnotes, endnotes have the advantage of not affecting the layout of the main text, but may cause inconvenience to readers who have to move back and forth between the main text and the endnotes.");

        WordRepository.create(context,"FTP","The File Transfer Protocol (FTP) is a standard network protocol used for the transfer of computer files between a client and server on a computer network.");

        WordRepository.create(context,"GPU","A graphics processing unit (GPU) is a specialized electronic circuit designed to rapidly manipulate and alter memory to accelerate the creation of images in a frame buffer intended for output to a display device. GPUs are used in embedded systems, mobile phones, personal computers, workstations, and game consoles. Modern GPUs are very efficient at manipulating computer graphics and image processing. Their highly parallel structure makes them more efficient than general-purpose central processing units (CPUs) for algorithms that process large blocks of data in parallel. In a personal computer, a GPU can be present on a video card or embedded on the motherboard. In certain CPUs, they are embedded on the CPU die.");

        WordRepository.create(context,"HTTP","The Hypertext Transfer Protocol (HTTP) is an application protocol for distributed, collaborative, hypermedia information systems. HTTP is the foundation of data communication for the World Wide Web, where hypertext documents include hyperlinks to other resources that the user can easily access, for example by a mouse click or by tapping the screen in a web browser. HTTP was developed to facilitate hypertext and the World Wide Web.");

        WordRepository.create(context,"Mac OS","In 1984, Apple debuted the operating system that is now known as the \"Classic\" Mac OS with its release of the original Macintosh System Software. The system, rebranded \"Mac OS\" in 1996, was preinstalled on every Macintosh until 2002 and offered on Macintosh clones for a short time in the 1990s. Noted for its ease of use, it was also criticized for its lack of modern technologies compared to its competitors.");

        WordRepository.create(context,"Mandrake Linux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Martus","Benetech is a nonprofit social enterprise organization that empowers communities with software for social good. Previous projects include the Route 66 Literacy Project, the Miradi environmental project management software, Martus (human rights abuse reporting), and the Human Rights Data Analysis Group. Current program areas include global education, human rights, and poverty alleviation.");

        WordRepository.create(context,"Pirate","Though less famous and romanticized than Atlantic or Caribbean pirates, corsairs in the Mediterranean equaled or outnumbered the former at any given point in history. Mediterranean piracy was conducted almost entirely with galleys until the mid-17th century, when they were gradually replaced with highly maneuverable sailing vessels such as xebecs and brigantines. They were, however, of a smaller type than battle galleys, often referred to as galiots or fustas. Pirate galleys were small, nimble, lightly armed, but often heavily manned in order to overwhelm the often minimal crews of merchant ships. In general, pirate craft were extremely difficult for patrolling craft to actually hunt down and capture. Anne Hilarion de Tourville, a French admiral of the 17th century, believed that the only way to run down raiders from the infamous corsair Moroccan port of Salé was by using a captured pirate vessel of the same type. Using oared vessels to combat pirates was common, and was even practiced by the major powers in the Caribbean. Purpose-built galleys (or hybrid sailing vessels) were built by the English in Jamaica in 1683 and by the Spanish in the late 16th century. Specially-built sailing frigates with oar-ports on the lower decks, like the James Galley and Charles Galley, and oar-equipped sloops proved highly useful for pirate hunting, though they were not built in sufficient numbers to check piracy until the 1720s.");

        WordRepository.create(context,"Search engine","A web search engine or Internet search engine is a software system that is designed to carry out web search (Internet search), which means to search the World Wide Web in a systematic way for particular information specified in a textual web search query. The search results are generally presented in a line of results, often referred to as search engine results pages (SERPs). The information may be a mix of links to web pages, images, videos, infographics, articles, research papers, and other types of files. Some search engines also mine data available in databases or open directories. Unlike web directories, which are maintained only by human editors, search engines also maintain real-time information by running an algorithm on a web crawler. Internet content that is not capable of being searched by a web search engine is generally described as the deep web.");

        WordRepository.create(context,"Surfing the Internet","Jean Armour Polly is a librarian by profession, the author of a series of books on safe Internet services (Surfing the Internet, now freely available at Project Gutenberg), and has been an active Internet user since 1991.");

        WordRepository.create(context,"SSD","A solid-state drive (SSD) is a solid-state storage device that uses integrated circuit assemblies as memory to store data persistently. It is also sometimes called a solid-state device or a solid-state disk, although SSDs do not have physical disks.");

        WordRepository.create(context,"Trojan horse","Metaphorically, a \"Trojan Horse\" has come to mean any trick or stratagem that causes a target to invite a foe into a securely protected bastion or place. A malicious computer program which tricks users into willingly running it is also called a \"Trojan horse\" or simply a \"Trojan\".");

        WordRepository.create(context,"UNIX","Unix (/ˈjuːnɪks/; trademarked as UNIX) is a family of multitasking, multiuser computer operating systems that derive from the original AT&T Unix, development starting in the 1970s at the Bell Labs research center by Ken Thompson, Dennis Ritchie, and others.");

        WordRepository.create(context,"Visual Studio","Microsoft Visual Studio is an integrated development environment (IDE) from Microsoft. It is used to develop computer programs, as well as websites, web apps, web services and mobile apps. Visual Studio uses Microsoft software development platforms such as Windows API, Windows Forms, Windows Presentation Foundation, Windows Store and Microsoft Silverlight. It can produce both native code and managed code.");

        WordRepository.create(context,"Windows","Microsoft Windows is a group of several graphical operating system families, all of which are developed, marketed and sold by Microsoft. Each family caters to a certain sector of the computing industry. Active Microsoft Windows families include Windows NT and Windows IoT; these may encompass subfamilies, e.g. Windows Server or Windows Embedded Compact (Windows CE). Defunct Microsoft Windows families include Windows 9x, Windows Mobile and Windows Phone.");

        WordRepository.create(context,"Abstract class","Abstract classes can be created, signified, or simulated in several ways:");

        WordRepository.create(context,"Abstract method","An abstract method is one with only a signature and no implementation body. It is often used to specify that a subclass must provide an implementation of the method. Abstract methods are used to specify interfaces in some computer languages.");

        WordRepository.create(context,"Aspect-oriented","Aspect-oriented software development focuses on the identification, specification and representation of cross-cutting concerns and their modularization into separate functional units as well as their automated composition into a working system.");

        WordRepository.create(context,"Class method","Class methods are methods that are called on a class rather than an instance. They are typically used as part of an object meta-model. I.e, for each class, defined an instance of the class object in the meta-model is created. Meta-model protocols allow classes to be created and deleted. In this sense, they provide the same functionality as constructors and destructors described above. But in some languages such as the Common Lisp Object System (CLOS) the meta-model allows the developer to dynamically alter the object model at run time: e.g., to create new classes, redefine the class hierarchy, modify properties, etc.");

        WordRepository.create(context,"Copy constructor","Copy constructors define the actions performed by the compiler when copying class objects. A copy constructor has one formal parameter that is the type of the class (the parameter may be a reference to an object). It is used to create a copy of an existing object of the same class. Even though both classes are the same, it counts as a conversion constructor.");

        WordRepository.create(context,"Data-driven design","Responsibility-driven design is in direct contrast with data-driven design, which promotes defining the behavior of a class along with the data that it holds. Data-driven design is not the same as data-driven programming, which is concerned with using data to determine the control flow, not class design.");

        WordRepository.create(context,"Deep copy","Deep copying and creating deep twins can be done using the features deep_copy and deep_twin, again inherited from class ANY. These features have the potential to create many new objects, because they duplicate all the objects in an entire object structure. Because new duplicate objects are created instead of simply copying references to existing objects, deep operations will become a source of performance issues more readily than shallow operations.");

        WordRepository.create(context,"Early binding","A non-subclassable class has no subclasses, so it can be easily deduced at compile time that references or pointers to objects of that class are actually referencing instances of that class and not instances of subclasses (they don\'t exist) or instances of superclasses (upcasting a reference type violates the type system). Because the exact type of the object being referenced is known before execution, early binding (also called static dispatch) can be used instead of late binding (also called dynamic dispatch), which requires one or more virtual method table lookups depending on whether multiple inheritance or only single inheritance are supported in the programming language that is being used.");

        WordRepository.create(context,"Factory object","Factory objects are used in situations where getting hold of an object of a particular kind is a more complex process than simply creating a new object, notably if complex allocation or initialization is desired. Some of the processes required in the creation of an object include determining which object to create, managing the lifetime of the object, and managing specialized build-up and tear-down concerns of the object. The factory object might decide to create the object\'s class (if applicable) dynamically, return it from an object pool, do complex configuration on the object, or other things. Similarly, using this definition, a singleton implemented by the singleton pattern is a formal factory – it returns an object, but does not create new objects beyond the single instance.");

        WordRepository.create(context,"Interaction diagram","Interaction diagrams, a subset of behavior diagrams, emphasize the flow of control and data among the things in the system being modeled. For example, the sequence diagram shows how objects communicate with each other regarding a sequence of messages.");

        WordRepository.create(context,"Partial class","Partial classes have existed in Smalltalk under the name of Class Extensions for considerable time. With the arrival of the .NET framework 2, Microsoft introduced partial classes, supported in both C# 2.0 and Visual Basic 2005. WinRT also supports partial classes.");

        WordRepository.create(context,"Patterns","Any of the senses may directly observe patterns. Conversely, abstract patterns in science, mathematics, or language may be observable only by analysis. Direct observation in practice means seeing visual patterns, which are widespread in nature and in art. Visual patterns in nature are often chaotic, never exactly repeating, and often involve fractals. Natural patterns include spirals, meanders, waves, foams, tilings, cracks, and those created by symmetries of rotation and reflection. Patterns have an underlying mathematical structure; indeed, mathematics can be seen as the search for regularities, and the output of any function is a mathematical pattern. Similarly in the sciences, theories explain and predict regularities in the world.");

        WordRepository.create(context,"Pure virtual function","Pure virtual functions can also be used where the method declarations are being used to define an interface - similar to what the interface keyword in Java explicitly specifies. In such a use, derived classes will supply all implementations. In such a design pattern, the abstract class which serves as an interface will contain only pure virtual functions, but no data members or ordinary methods. In C++, using such purely abstract classes as interfaces works because C++ supports multiple inheritance. However, because many OOP languages do not support multiple inheritance, they often provide a separate interface mechanism. An example is the Java programming language.");

        WordRepository.create(context,"Deep copy","Deep copying and creating deep twins can be done using the features deep_copy and deep_twin, again inherited from class ANY. These features have the potential to create many new objects, because they duplicate all the objects in an entire object structure. Because new duplicate objects are created instead of simply copying references to existing objects, deep operations will become a source of performance issues more readily than shallow operations.");

        WordRepository.create(context,"Abstract class","Abstract classes can be created, signified, or simulated in several ways:");

        WordRepository.create(context,"Static method","Static methods are meant to be relevant to all the instances of a class rather than to any specific instance. They are similar to static variables in that sense. An example would be a static method to sum the values of all the variables of every instance of a class. For example, if there were a Product class it might have a static method to compute the average price of all products.");


        WordRepository.create(context,"Application","Application is any material product or a program which is designed for end-user to use. Application may refer to:");


        WordRepository.create(context,"web browser","A web browser (commonly referred to as a browser) is a software application for accessing information on the World Wide Web. Each individual web page, image, and video is identified by a distinct Uniform Resource Locator (URL), enabling browsers to retrieve these resources from a web server and display them on a user\'s device.");

        WordRepository.create(context,"web page","A web page (also written as webpage) is a document that is suitable to act as a web resource on the World Wide Web. In order to graphically display a web page, a web browser is needed. This is a type of software that can retrieve web pages from the Internet. When accessed by a web browser it may be displayed as a web page on a monitor or mobile device. Typical web pages are hypertext documents which contain hyperlinks, often referred to as links, for browsing to other web pages.");

        WordRepository.create(context,"data compression","In signal processing, data compression, source coding, or bit-rate reduction involves encoding information using fewer bits than the original representation. Compression can be either lossy or lossless. Lossless compression reduces bits by identifying and eliminating statistical redundancy. No information is lost in lossless compression. Lossy compression reduces bits by removing unnecessary or less important information.");

        WordRepository.create(context,"G400","The G400 is a video card made by Matrox, released in September 1999. The graphics processor contains a 2D GUI, video, and Direct3D 6.0 3D accelerator. Codenamed \"Toucan\", it was a more powerful and refined version of its predecessor, the G200.");

        WordRepository.create(context,"Android","Android is a mobile operating system developed by Google. It is based on a modified version of the Linux kernel and other open source software, and is designed primarily for touchscreen mobile devices such as smartphones and tablets. In addition, Google has developed Android TV for televisions, Android Auto for cars, and Wear OS for wrist watches, each with a specialized user interface. Variants of Android are also used on game consoles, digital cameras, PCs and other electronics.");

        WordRepository.create(context,"Analog device","Analog device is usually a combination of both analog machine and analog media that can together measure, record, reproduce, or broadcast continuous information, for example, the almost infinite number of grades of transparency, voltage, resistance, rotation, or pressure. In theory, the continuous information (also analog signal) has an infinite number of possible values with the only limitation on resolution being the accuracy of the analog device.");

        WordRepository.create(context,"binary number","In mathematics and digital electronics, a binary number is a number expressed in the base-2 numeral system or binary numeral system, which uses only two symbols: typically \"0\" (zero) and \"1\" (one).");

        WordRepository.create(context,"computer file","A computer file is a computer resource for recording data discretely in a computer storage device. Just as words can be written to paper, so can information be written to a computer file. Files can be edited and transferred through the internet on that particular computer system.");

        WordRepository.create(context,"firewall","In computing, a firewall is a network security system that monitors and controls incoming and outgoing network traffic based on predetermined security rules. A firewall typically establishes a barrier between a trusted internal network and untrusted external network, such as the Internet.");

        WordRepository.create(context,"file format","A file format is a standard way that information is encoded for storage in a computer file. It specifies how bits are used to encode information in a digital storage medium. File formats may be either proprietary or free and may be either unpublished or open.");

        WordRepository.create(context,"GIMP","GIMP (/ɡɪmp/ GHIMP; GNU Image Manipulation Program) is a free and open-source raster graphics editor used for image retouching and editing, free-form drawing, converting between different image formats, and more specialized tasks.");

        WordRepository.create(context,"Computer hardware","Computer hardware includes the physical, tangible parts or components of a computer, such as the cabinet, central processing unit, monitor, keyboard, computer data storage, graphics card, sound card, speakers and motherboard. By contrast, software is instructions that can be stored and run by hardware. Hardware is so-termed because it is \"hard\" or rigid with respect to changes or modifications; whereas software is \"soft\" because it is easy to update or change. Intermediate between software and hardware is \"firmware\", which is software that is strongly coupled to the particular hardware of a computer system and thus the most difficult to change but also among the most stable with respect to consistency of interface. The progression from levels of \"hardness\" to \"softness\" in computer systems parallels a progression of layers of abstraction in computing.");

        WordRepository.create(context,"kernel ","The critical code of the kernel is usually loaded into a separate area of memory, which is protected from access by application programs or other, less critical parts of the operating system. The kernel performs its tasks, such as running processes, managing hardware devices such as the hard disk, and handling interrupts, in this protected kernel space. In contrast, everything a user does is in user space: writing text in a text editor, running programs in a GUI, etc. This separation prevents user data and kernel data from interfering with each other and causing instability and slowness, as well as preventing malfunctioning application programs from crashing the entire operating system.");

        WordRepository.create(context,"computer keyboard","A computer keyboard is a typewriter-style device which uses an arrangement of buttons or keys to act as mechanical levers or electronic switches. Following the decline of punch cards and paper tape, interaction via teleprinter-style keyboards became the main input method for computers.");

        WordRepository.create(context,"key","In cryptography, a key is a piece of information (a parameter) that determines the functional output of a cryptographic algorithm. For encryption algorithms, a key specifies the transformation of plaintext into ciphertext, and vice versa for decryption algorithms. Keys also specify transformations in other cryptographic algorithms, such as digital signature schemes and message authentication codes.");

        WordRepository.create(context,"reserved word","In a computer language, a reserved word (also known as a reserved identifier) is a word that cannot be used as an identifier, such as the name of a variable, function, or label – it is \"reserved from use\". This is a syntactic definition, and a reserved word may have no meaning.");

        WordRepository.create(context,"hyperlink","In computing, a hyperlink, or simply a link, is a reference to data that the reader can follow by clicking or tapping. A hyperlink points to a whole document or to a specific element within a document. Hypertext is text with hyperlinks. The text that is linked from is called anchor text. A software system that is used for viewing and creating hypertext is a hypertext system, and to create a hyperlink is to hyperlink (or simply to link). A user following hyperlinks is said to navigate or browse the hypertext.");

        WordRepository.create(context,"computer monitor","A computer monitor is an output device that displays information in pictorial form. A monitor usually comprises the display device, circuitry, casing, and power supply. The display device in modern monitors is typically a thin film transistor liquid crystal display (TFT-LCD) with LED backlighting having replaced cold-cathode fluorescent lamp (CCFL) backlighting. Older monitors used a cathode ray tube (CRT). Monitors are connected to the computer via VGA, Digital Visual Interface (DVI), HDMI, DisplayPort, Thunderbolt, low-voltage differential signaling (LVDS) or other proprietary connectors and signals.");

        WordRepository.create(context,"social networking service","A social networking service (also social networking site, or SNS or social media) is an online platform which people use to build social networks or social relationship with other people who share similar personal or career interests, activities, backgrounds or real-life connections.");

        WordRepository.create(context,"Pretty Good Privacy","Pretty Good Privacy (PGP) is an encryption program that provides cryptographic privacy and authentication for data communication. PGP is used for signing, encrypting, and decrypting texts, e-mails, files, directories, and whole disk partitions and to increase the security of e-mail communications. Phil Zimmermann developed PGP in 1991.");

        WordRepository.create(context,"plug-in","In computing, a plug-in (or plugin, add-in, addin, add-on, or addon) is a software component that adds a specific feature to an existing computer program. When a program supports plug-ins, it enables customization.");

        WordRepository.create(context,"printer","In computing, a printer is a peripheral device which makes a persistent representation of graphics or text on paper. While most output is human-readable, bar code printers are an example of an expanded use for printers.");

        WordRepository.create(context,"computer program","A computer program is a collection of instructions that performs a specific task when executed by a computer. Most computer devices require programs to function properly.");

        WordRepository.create(context,"Python","Python is an interpreted, high-level, general-purpose programming language. Created by Guido van Rossum and first released in 1991, Python\'s design philosophy emphasizes code readability with its notable use of significant whitespace. Its language constructs and object-oriented approach aims to help programmers write clear, logical code for small and large-scale projects.");

        WordRepository.create(context,"server","In computing, a server is a computer program or a device that provides functionality for other programs or devices, called \"clients\". This architecture is called the client–server model, and a single overall computation is distributed across multiple processes or devices. Servers can provide various functionalities, often called \"services\", such as sharing data or resources among multiple clients, or performing computation for a client. A single server can serve multiple clients, and a single client can use multiple servers. A client process may run on the same device or may connect over a network to a server on a different device. Typical servers are database servers, file servers, mail servers, print servers, web servers, game servers, and application servers.");

        WordRepository.create(context,"SUSE Linux","SUSE Linux (/ˈsuːsə/ or /ˈsuːzə/; German: [ˈzuːzə]) is a computer operating system. It is built on top of the free and open source Linux kernel and is distributed with system and application software from other open source projects. SUSE Linux is of German origin, basically an acronym of “Software und System-Entwicklung” (software and systems development), and was mainly developed in Europe. The first version appeared in early 1994, making SUSE one of the oldest existing commercial distributions. It is known for its YaST configuration tool.");

        WordRepository.create(context,"software development kit","A software development kit (SDK or devkit) is typically a set of software development tools that allows the creation of applications for a certain software package, software framework, hardware platform, computer system, video game console, operating system, or similar development platform. To enrich applications with advanced functionalities, advertisements, push notifications, and more, most app developers implement specific software development kits. Some SDKs are critical for developing a platform-specific app. For example, the development of an Android app on Java platform requires a Java Development Kit, for iOS apps the iOS SDK, and for Universal Windows Platform the .NET Framework SDK. There are also SDKs that are installed in apps to provide analytics and data about application activity; prominent creators of these types of SDKs include Google, InMobi, and Facebook.");

        WordRepository.create(context,"UPDATE","An SQL UPDATE statement changes the data of one or more records in a table. Either all the rows can be updated, or a subset may be chosen using a condition.");

        WordRepository.create(context,"user","A user is a person who utilizes a computer or network service. Users of computer systems and software products generally lack the technical expertise required to fully understand how they work. Power users use advanced features of programs, though they are not necessarily capable of computer programming and system administration.");

        WordRepository.create(context,"Software upgrade versioning","Software upgrade versioning is the process of assigning either unique version names or unique version numbers to unique states of computer software. Within a given version number category (major, minor), these numbers are generally assigned in increasing order and correspond to new developments in the software. At a fine-grained level, revision control is often used for keeping track of incrementally different versions of information, whether or not this information is computer software.");

        WordRepository.create(context,"type conversion","In computer science, type conversion, type casting, type coercion, and type juggling are different ways of changing an expression from one data type to another. An example would be the conversion of an integer value into a floating point value or its textual representation as a string, and vice versa. Type conversions can take advantage of certain features of type hierarchies or data representations. Two important aspects of a type conversion are whether it happens implicitly (automatically) or explicitly, and whether the underlying data representation is converted from one representation into another, or a given representation is merely reinterpreted as the representation of another data type. In general, both primitive and compound data types can be converted.");

        WordRepository.create(context,"destructor","In object-oriented programming, a destructor (sometimes abbreviated dtor) is a method which is automatically invoked when the object is destroyed. It can happen when its lifetime is bound to scope and the execution leaves the scope, when it is embedded in another object whose lifetime ends, or when it was allocated dynamically and is released explicitly. Its main purpose is to free the resources (memory allocations, open files or sockets, database connections, resource locks, etc.) which were acquired by the object during its life and/or deregister from other entities which may keep references to it. Use of destructors is needed for the process of Resource Acquisition Is Initialization (RAII).");

        WordRepository.create(context,"class","In object-oriented programming, a class is an extensible program-code-template for creating objects, providing initial values for state (member variables) and implementations of behavior (member functions or methods). In many languages, the class name is used as the name for the class (the template itself), the name for the default constructor of the class (a subroutine that creates objects), and as the type of objects generated by instantiating the class; these distinct concepts are easily conflated.");

        WordRepository.create(context,"cohesion ","Cohesion is an ordinal type of measurement and is usually described as “high cohesion” or “low cohesion”. Modules with high cohesion tend to be preferable, because high cohesion is associated with several desirable traits of software including robustness, reliability, reusability, and understandability. In contrast, low cohesion is associated with undesirable traits such as being difficult to maintain, test, reuse, or even understand.");

        WordRepository.create(context,"object composition","In computer science, object composition is a way to combine objects or data types into more complex ones. Compositions relate to, but are not the same as, data structures, and common ones are the tagged union, set, sequence, and various graph structures, as well as the object used in object-oriented programming.");

        WordRepository.create(context,"constructor","In class-based object-oriented programming, a constructor (abbreviation: ctor) is a special type of subroutine called to create an object. It prepares the new object for use, often accepting arguments that the constructor uses to set required member variables.");

        WordRepository.create(context,"addon","In computing, a plug-in (or plugin, add-in, addin, add-on, or addon) is a software component that adds a specific feature to an existing computer program. When a program supports plug-ins, it enables customization.");

        WordRepository.create(context,"fields","In computer science, data that has several parts, known as a record, can be divided into fields. Relational databases arrange data as sets of database records, also called rows. Each record consists of several fields; the fields of all records form the columns. Examples of fields: name, gender, hair colour.");

        WordRepository.create(context,"associated","Most programming languages support more than one programming paradigm to allow programmers to use the most suitable programming style and associated language constructs for a given job.");

        WordRepository.create(context,"interface","In computing, an interface is a shared boundary across which two or more separate components of a computer system exchange information. The exchange can be between software, computer hardware, peripheral devices, humans, and combinations of these. Some computer hardware devices, such as a touchscreen, can both send and receive data through the interface, while others such as a mouse or microphone may only provide an interface to send data to a given system.");

        WordRepository.create(context,"function overloading","In some programming languages, function overloading or method overloading is the ability to create multiple functions of the same name with different implementations. Calls to an overloaded function will run a specific implementation of that function appropriate to the context of the call, allowing one function call to perform different tasks depending on context.");

        WordRepository.create(context,"package manager","A package manager or package-management system is a collection of software tools that automates the process of installing, upgrading, configuring, and removing computer programs for a computer\'s operating system in a consistent manner.");

        WordRepository.create(context,"communication protocol","In telecommunication, a communication protocol is a system of rules that allow two or more entities of a communications system to transmit information via any kind of variation of a physical quantity. The protocol defines the rules, syntax, semantics and synchronization of communication and possible error recovery methods. Protocols may be implemented by hardware, software, or a combination of both.[not in citation given]");

        WordRepository.create(context,"Refinement","Refinement is a generic term of computer science that encompasses various approaches for producing correct computer programs and simplifying existing programs to enable their formal verification.");

        WordRepository.create(context,"reflection","In computer science, reflection is the ability of a process to examine, introspect, and modify its own structure and behavior.");

        WordRepository.create(context,"program slicing","In computer programming, program slicing is the computation of the set of program statements, the program slice, that may affect the values at some point of interest, referred to as a slicing criterion. Program slicing can be used in debugging to locate source of errors more easily. Other applications of slicing include software maintenance, optimization, program analysis, and information flow control.");

        WordRepository.create(context,"trait","In computer programming, a trait is a concept used in object-oriented programming, which represents a set of methods that can be used to extend the functionality of a class.");

        WordRepository.create(context,"data type","In computer science and computer programming, a data type or simply type is an attribute of data which tells the compiler or interpreter how the programmer intends to use the data. Most programming languages support common data types of real, integer and boolean. A data type constrains the values that an expression, such as a variable or a function, might take. This data type defines the operations that can be done on the data, the meaning of the data, and the way values of that type can be stored. A type of value from which an expression may take its value.");
