        WordRepository.create(context,"10BASE-F","10BASE-F, or sometimes 10BASE-FX, is a generic term for the family of 10 Mbit/s Ethernet standards using fiber optic cable. In 10BASE-F, the 10 represents a maximum throughput of 10 Mbit/s, BASE indicates its use of baseband transmission, and F indicates that it relies on medium of fiber-optic cable.");

        WordRepository.create(context,"10BASE-FB","10BASE-F, or sometimes 10BASE-FX, is a generic term for the family of 10 Mbit/s Ethernet standards using fiber optic cable. In 10BASE-F, the 10 represents a maximum throughput of 10 Mbit/s, BASE indicates its use of baseband transmission, and F indicates that it relies on medium of fiber-optic cable.");

        WordRepository.create(context,"10BASE-FL","10BASE-F, or sometimes 10BASE-FX, is a generic term for the family of 10 Mbit/s Ethernet standards using fiber optic cable. In 10BASE-F, the 10 represents a maximum throughput of 10 Mbit/s, BASE indicates its use of baseband transmission, and F indicates that it relies on medium of fiber-optic cable.");

        WordRepository.create(context,"2NF","Second normal form (2NF) is a normal form used in database normalization. 2NF was originally defined by E.F. Codd in 1971.");

