        WordRepository.create(context,"3NF","Third normal form (3NF) is a normal form that is used in normalizing a database design to reduce the duplication of data and ensure referential integrity by ensuring that:");

        WordRepository.create(context,"4NF","Fourth normal form (4NF) is a normal form used in database normalization. Introduced by Ronald Fagin in 1977, 4NF is the next level of normalization after Boyce–Codd normal form (BCNF). Whereas the second, third, and Boyce–Codd normal forms are concerned with functional dependencies, 4NF is concerned with a more general type of dependency known as a multivalued dependency. A table is in 4NF if and only if, for every one of its non-trivial multivalued dependencies X {\\displaystyle \\twoheadrightarrow }  \"\\twoheadrightarrow Y, X is a superkey—that is, X is either a candidate key or a superset thereof.");

        WordRepository.create(context,"6NF","Sixth normal form (6NF) is a term in relational database theory, used in two different ways.");

        WordRepository.create(context,"Asynchronous Balanced Mode","HDLC can be used for point-to-multipoint connections via the original master-slave modes Normal Response Mode (NRM) and Asynchronous Response Mode (ARM), but they are now rarely used; is now used almost exclusively to connect one device to another, using Asynchronous Balanced Mode (ABM).");

        WordRepository.create(context,"ACID","In computer science, ACID (Atomicity, Consistency, Isolation, Durability) is a set of properties of database transactions intended to guarantee validity even in the event of errors, power failures, etc. In the context of databases, a sequence of database operations that satisfies the ACID properties (and these can be perceived as a single logical operation on the data) is called a transaction. For example, a transfer of funds from one bank account to another, even involving multiple changes such as debiting one account and crediting another, is a single transaction.");

        WordRepository.create(context,"Automated Classification of Medical Entities","The Automated Classification of Medical Entities program automates the underlying cause-of-death coding rules. The input to ACME is the multiple cause-of-death codes (ICD) assigned to each entity (e.g., disease condition, accident, or injury) listed on cause-of-death certifications, preserving the location and order as reported by the certifier. ACME then applies the World Health Organization (WHO) rules to the ICD codes and selects an underlying cause of death. ACME has become the de facto international standard for the automated selection of the underlying cause of death. (Johansson & Westerling 2002:302)");

        WordRepository.create(context,"Apple Lossless Audio Codec","Apple Lossless, also known as Apple Lossless Audio Codec (ALAC), or Apple Lossless Encoder (ALE), is an audio coding format, and its reference audio codec implementation, developed by Apple Inc. for lossless data compression of digital music. After initially keeping it proprietary from its inception in 2004, in late 2011 Apple made the codec available open source and royalty-free. Traditionally, Apple has referred to the codec as Apple Lossless, though more recently it has begun to use the abbreviated term ALAC when referring to the codec.");

        WordRepository.create(context,"Advanced Research Projects Agency","The Defense Advanced Research Projects Agency (DARPA) is an agency of the United States Department of Defense responsible for the development of emerging technologies for use by the military.");

        WordRepository.create(context,"Authoring Tool Accessibility Guidelines","The Authoring Tool Accessibility Guidelines Working Group develops guidelines, techniques and supporting resources for tools that create web content, ranging from desktop HTML editors to content management systems. The accessibility requirements apply to two types of things: the user interface on the one hand, and the content produced by the tool on the other. The working group consists of representatives from organizations that produce authoring tools, researchers, and other accessibility experts. The working group produced the Authoring Tool Accessibility Guidelines 1.0 in 2000 and completed Authoring Tool Accessibility Guidelines (ATAG) 2.0 in 2015. A supporting document, Implementing ATAG 2.0, provides additional explanation, examples and resources for ATAG 2.0. It also published a document on Selecting and Using Authoring Tools for Web Accessibility.");

        WordRepository.create(context,"Boot Configuration Data","In this article, unless otherwise specified, what is said about \"Windows Vista\" also applies to all later NT operating systems. For Windows Vista, the boot sector or UEFI loads the Windows Boot Manager (a file named BOOTMGR on either the system or the boot partition), accesses the Boot Configuration Data store and uses the information to load the operating system. Then, the BCD invokes the boot loader and in turn proceeds to initiate the Windows kernel. Initialization at this point proceeds similarly to previous Windows NT.");
        WordRepository.create(context,"Byzantine fault tolerance","Byzantine fault tolerance (BFT) is the dependability of a fault-tolerant computer system to such conditions.");

        WordRepository.create(context,"Basic Multilingual Plane","In the Unicode standard, a plane is a continuous group of 65,536 (216) code points. There are 17 planes, identified by the numbers 0 to 16, which corresponds with the possible values 00–1016 of the first two positions in six position hexadecimal format (U+hhhhhh). Plane 0 is the Basic Multilingual Plane (BMP), which contains most commonly-used characters. The higher planes 1 through 16 are called \"supplementary planes\". The very last code point in Unicode is the last code point in plane 16, U+10FFFF. As of Unicode version 12.1, six of the planes have assigned code points (characters), and four are named.");

        WordRepository.create(context,"BPDU","Bridge Protocol Data Units (BPDUs) are frames that contain information about the spanning tree protocol (STP). A switch sends BPDUs using a unique MAC address from its origin port and a multicast address as destination MAC (01:80:C2:00:00:00, or 01:00:0C:CC:CC:CD for Per VLAN Spanning Tree). For STP algorithms to function, the switches need to share information about themselves and their connections. What they share are bridge protocol data units (BPDUs). BPDUs are sent out as multicast frames to which only other layer 2 switches or bridges are listening. If any loops (multiple possible paths between switches) are found in the network topology, the switches will co-operate to disable a port or ports to ensure that there are no loops; that is, from one device to any other device in the layer 2 network, only one path can be taken.");

        WordRepository.create(context,"Business Software Alliance","The Software Alliance, also known as BSA, is a trade group established by Microsoft Corporation in 1988 and representing a number of the world\'s largest software makers and is a member of the International Intellectual Property Alliance. Its principal activity is trying to stop copyright infringement of software produced by its members. Founded as the Business Software Alliance, it dropped \"Business\" from its name in October 2012, and styles itself \"BSA | The Software Alliance\".");

        WordRepository.create(context,"Fiber to the premises","Fiber to the premises (FTTP) is a form of fiber-optic communication delivery, in which an optical fiber is run in an optical distribution network from the central office all the way to the premises occupied by the subscriber. The term \"FTTP\" has become ambiguous and may also refer to FTTC where the fiber terminates at a utility pole without reaching the premises.");

        WordRepository.create(context,"For Your Information","An informational RFC can be nearly anything from April 1 jokes to widely recognized essential RFCs like Domain Name System Structure and Delegation (RFC 1591). Some informational RFCs formed the FYI sub-series.");

        WordRepository.create(context,"Graphics Interchange Format","The Graphics Interchange Format (GIF /dʒɪf/ JIF or /ɡɪf/ GHIF), is a bitmap image format that was developed by a team at the online services provider CompuServe led by American computer scientist Steve Wilhite on June 15, 1987. It has since come into widespread usage on the World Wide Web due to its wide support and portability between many applications and operating systems.");

        WordRepository.create(context,"IBM General Parallel File System","Before 2015, Spectrum Scale was known as IBM General Parallel File System (GPFS).");

        WordRepository.create(context,"GPGPU","General-purpose computing on graphics processing units (GPGPU, rarely GPGP) is the use of a graphics processing unit (GPU), which typically handles computation only for computer graphics, to perform computation in applications traditionally handled by the central processing unit (CPU). The use of multiple video cards in one computer, or large numbers of graphics chips, further parallelizes the already parallel nature of graphics processing. In addition, even a single GPU-CPU framework provides advantages that multiple CPUs on their own do not offer due to the specialization in each chip.");

        WordRepository.create(context,"GPIB","IEEE 488 is a short-range digital communications 8-bit parallel multi-master interface bus specification. IEEE 488 was created as HP-IB (Hewlett-Packard Interface Bus) and is commonly called GPIB (General Purpose Interface Bus). It has been the subject of several standards.");

        WordRepository.create(context,"High density","High density (HD) improves capacity by utilizing a 96 tpi track density in conjunction with improved cobalt disk coating and stronger 600-oersted write heads, allowing 9646 bpi to be written.");

        WordRepository.create(context,"HECI","Host Embedded Controller Interface (HECI) is technology introduced in 2006 used for Active Management Technology (AMT) in Intel chipsets that support Core 2 Duo microprocessors.");

        WordRepository.create(context,"Information Technology Infrastructure Library","ITIL, formerly an acronym for Information Technology Infrastructure Library, is a set of detailed practices for IT service management (ITSM) that focuses on aligning IT services with the needs of business.");

        WordRepository.create(context,"JBOD","JBOD (abbreviated from \"just a bunch of disks/drives\") is an architecture using multiple hard drives exposed as individual devices. Hard drives may be treated independently or may be combined into one or more logical volumes using a volume manager like LVM or mdadm; such volumes are usually called \"spanned\" or \"linear | SPAN | BIG\". A spanned volume provides no redundancy, so failure of a single hard drive amounts to failure of the whole logical volume. Redundancy for resilience and/or bandwidth improvement may be provided, in software, at a higher level.");

        WordRepository.create(context,"Java Runtime Environment","The Java Runtime Environment (JRE) released by Oracle is a freely available software distribution containing a stand-alone JVM (HotSpot), the Java standard library (Java Class Library), a configuration tool, and—until its discontinuation in JDK 9—a browser plug-in. It is the most common Java environment installed on personal computers in the laptop and desktop form factor. Mobile phones including feature phones and early smartphones that ship with a JVM are most likely to include a JVM meant to run applications targeting Micro Edition of the Java platform. Meanwhile, most modern smartphones, tablet computers, and other handheld PCs that run Java apps are most likely to do so through support of the Android operating system, which includes an open source virtual machine incompatible with the JVM specification. (Instead, Google\'s Android development tools take Java programs as input and output Dalvik bytecode, which is the native input format for the virtual machine on Android devices.)");

        WordRepository.create(context,"Joint Test Action Group","JTAG (named after the Joint Test Action Group which codified it) is an industry standard for verifying designs and testing printed circuit boards after manufacture.");

        WordRepository.create(context,"Link Aggregation Control Protocol","Other umbrella terms used to describe the method include port trunking, link bundling, Ethernet/network/NIC bonding,, channel bonding or NIC teaming. These umbrella terms encompass not only vendor-independent standards such as Link Aggregation Control Protocol (LACP) for Ethernet defined in IEEE 802.1AX or the previous IEEE 802.3ad, but also various proprietary solutions.");

        WordRepository.create(context,"Least Recently Used","Discards the least recently used items first. This algorithm requires keeping track of what was used when, which is expensive if one wants to make sure the algorithm always discards the least recently used item. General implementations of this technique require keeping \"age bits\" for cache-lines and track the \"Least Recently Used\" cache-line based on age-bits. In such an implementation, every time a cache-line is used, the age of all other cache-lines changes. LRU is actually a family of caching algorithms with members including 2Q by Theodore Johnson and Dennis Shasha, and LRU/K by Pat O\'Neil, Betty O\'Neil and Gerhard Weikum.");

        WordRepository.create(context,"Least Significant Bit","This table illustrates an example of decimal value of 149 and the location of LSB. In this particular example, the position of unit value (decimal 1 or 0) is located in bit position 0 ( n=0). MSB stands for Most Significant Bit, while LSB stands for Least Significant Bit.");

        WordRepository.create(context,"Large-Scale Integration","Wafer-scale integration (WSI) is a means of building very large integrated circuits that uses an entire silicon wafer to produce a single \"super-chip\". Through a combination of large size and reduced packaging, WSI could lead to dramatically reduced costs for some systems, notably massively parallel supercomputers. The name is taken from the term Very-Large-Scale Integration, the current state of the art when WSI was being developed.");

        WordRepository.create(context,"Messaging Application Programming Interface","Messaging Application Programming Interface (MAPI) is an API for Microsoft Windows which allows programs to become email-aware. While MAPI is designed to be independent of the protocol, it is usually used to communicate with Microsoft Exchange Server.");

        WordRepository.create(context,"Megahertz","In computers, most central processing units (CPU) are labeled in terms of their clock rate expressed in megahertz (106 Hz) or gigahertz (109 Hz). This specification refers to the frequency of the CPU\'s master clock signal. This signal is a square wave, which is an electrical voltage that switches between low and high logic values at regular intervals. As the hertz has become the primary unit of measurement accepted by the general populace to determine the performance of a CPU, many experts have criticized this approach, which they claim is an easily manipulable benchmark. Some processors use multiple clock periods to perform a single operation, while others can perform multiple operations in a single cycle. For personal computers, CPU clock speeds have ranged from approximately 1 MHz in the late 1970s (Atari, Commodore, Apple computers) to up to 6 GHz in IBM POWER microprocessors.");

        WordRepository.create(context,"Musical Instrument Digital Interface","MIDI (/ˈmɪdi/; short for Musical Instrument Digital Interface) is a technical standard that describes a communications protocol, digital interface, and electrical connectors that connect a wide variety of electronic musical instruments, computers, and related audio devices for playing, editing and recording music. A single MIDI link through a MIDI cable can carry up to sixteen channels of information, each of which can be routed to a separate device or instrument. This could be sixteen different digital instruments, for example.");

        WordRepository.create(context,"Metaobject protocol","Metaobject protocol is contrary to Bertrand Meyer\'s open/closed principle, which holds that software object systems should be open for extension but closed for modification. This principle effectively draws a distinction between extending an object by adding to it, and modifying an object by redefining it, proposing that the former is a desirable quality (\"objects should be extensible to meet the requirements of future use cases\"), while the latter is undesirable (\"objects should provide a stable interface not subject to summary revision\"). Metaobject protocol, by contrast, transparently exposes the internal composition of objects and the entire object system in terms of the system itself. In practice, this means that programmers may use objects to redefine themselves, possibly in quite complex ways.");

        WordRepository.create(context,"Microsoft Network","The Microsoft Network was initially a subscription-based dial-up online service that later became an Internet service provider named MSN Dial-up. At the same time, the company launched a new web portal named Microsoft Internet Start and set it as the first default home page of Internet Explorer, its web browser. In 1998, Microsoft renamed and moved this web portal to the domain name www.msn.com, where it has remained.");

        WordRepository.create(context,"MTBF","Mean time between failures (MTBF) is the predicted elapsed time between inherent failures of a mechanical or electronic system, during normal system operation. MTBF can be calculated as the arithmetic mean (average) time between failures of a system. The term is used for repairable systems, while mean time to failure (MTTF) denotes the expected time to failure for a non-repairable system.");

        WordRepository.create(context,"Novell Directory Services","eDirectory is an X.500-compatible directory service software product from NetIQ. Previously owned by Novell, the product has also been known as Novell Directory Services (NDS) and sometimes referred to as NetWare Directory Services. NDS was initially released by Novell in 1993 for Netware 4, replacing the Netware bindery mechanism used in previous versions, for centrally managing access to resources on multiple servers and computers within a given network. eDirectory is a hierarchical, object oriented database used to represent certain assets in an organization in a logical tree, including organizations, organizational units, people, positions, servers, volumes, workstations, applications, printers, services, and groups to name just a few.");

        WordRepository.create(context,"NTLM","In a Windows network, NT (New Technology) LAN Manager (NTLM) is a suite of Microsoft security protocols intended to provide authentication, integrity, and confidentiality to users. NTLM is the successor to the authentication protocol in Microsoft LAN Manager (LANMAN), an older Microsoft product. The NTLM protocol suite is implemented in a Security Support Provider, which combines the LAN Manager authentication protocol, NTLMv1, NTLMv2 and NTLM2 Session protocols in a single package. Whether these protocols are used or can be used on a system is governed by Group Policy settings, for which different versions of Windows have different default settings. NTLM passwords are considered weak because they can be brute-forced very easily with modern hardware.");

        WordRepository.create(context,"OBSAI","The Open Base Station Architecture Initiative (OBSAI) was a trade association created by Hyundai, LG Electronics, Nokia, Samsung and ZTE in September 2002 with the aim of creating an open market for cellular network base stations. The hope was that an open market would reduce the development effort and costs traditionally associated with creating base station products.");

        WordRepository.create(context,"Open Source Technology Group","By April 2004, the company focused on SourceForge, an online software application, and OSDN, a group of websites catering to people in the information technology and software development industries, which was renamed to Open Source Technology Group. At that time, the stock was trading at $1.94/share.");

        WordRepository.create(context,"Peripheral Component Interconnect","Conventional PCI, often shortened to PCI, is a local computer bus for attaching hardware devices in a computer. PCI is an abbreviation for Peripheral Component Interconnect and is part of the PCI Local Bus standard. The PCI bus supports the functions found on a processor bus but in a standardized format that is independent of any particular processor\'s native bus. Devices connected to the PCI bus appear to a bus master to be connected directly to its own bus and are assigned addresses in the processor\'s address space. It is a parallel bus, synchronous to a single bus clock.");

        WordRepository.create(context,"Portable Document Format","The Portable Document Format (PDF) (redundantly: PDF format) is a file format developed by Adobe in the 1990s to present documents, including text formatting and images, in a manner independent of application software, hardware, and operating systems. Based on the PostScript language, each PDF file encapsulates a complete description of a fixed-layout flat document, including the text, fonts, vector graphics, raster images and other information needed to display it. PDF was standardized as an open format, ISO 32000, in 2008, and no longer requires any royalties for its implementation.");

        WordRepository.create(context,"Pixels per inch","Pixels per inch (ppi) or pixels per centimetre (ppcm or pixels/cm) are measurements of the pixel density (resolution) of an electronic image device, such as a computer monitor or television display, or image digitizing device such as a camera or image scanner. Horizontal and vertical density are usually the same, as most devices have square pixels, but differ on devices that have non-square pixels.");

        WordRepository.create(context,"PSVI","This collection of information is called the Post-Schema-Validation Infoset (PSVI). The PSVI gives a valid XML document its \"type\" and facilitates treating the document as an object, using object-oriented programming (OOP) paradigms.");

        WordRepository.create(context,"RACF","RACF, [usually pronounced Rack-Eff] short for Resource Access Control Facility, is an IBM software product. It is a security system that provides access control and auditing functionality for the z/OS and z/VM operating systems. RACF was introduced in 1976.");

        WordRepository.create(context,"Remote Desktop Connection","A RemoteApp can be packaged either as a .rdp file or distributed via an .msi Windows Installer package. When packaged as an .rdp file (which contains the address of the RemoteApp server, authentication schemes to be used, and other settings), a RemoteApp can be launched by double clicking the file. It will invoke the Remote Desktop Connection client, which will connect to the server and render the UI. The RemoteApp can also be packaged in a Windows Installer database, installing which can register the RemoteApp in the Start menu as well as create shortcuts to launch it. A RemoteApp can also be registered as handler for file types or URIs. Opening a file registered with RemoteApp will first invoke Remote Desktop Connection, which will connect to the terminal server and then open the file. Any application which can be accessed over Remote Desktop can be served as a RemoteApp.");

        WordRepository.create(context,"RTOS","A real-time operating system (RTOS) is any operating system (OS) intended to serve real-time applications that process data as it comes in, typically without buffer delays. Processing time requirements (including any OS delay) are measured in tenths of seconds or shorter increments of time. A real time system is a time bound system which has well defined fixed time constraints. Processing must be done within the defined constraints or the system will fail. They either are event driven or time sharing. Event driven systems switch between tasks based on their priorities while time sharing systems switch the task based on clock interrupts. Most RTOSs use a pre-emptive scheduling algorithm.");

        WordRepository.create(context,"ROM-DOS","Datalight was founded in 1983 by Roy Sherrill, a former Boeing engineer. Datalight\'s initial products were two DOS applications: the Datalight Small-C compiler and the Datalight C-Bug debugger. A full C compiler named Datalight C was available from Datalight between 1987 and 1993; Datalight C, developed by Walter Bright, evolved into Zortech C and is now Digital Mars C. Datalight C was also developed into an optimizing compiler called Datalight Optimum-C, which later became Zortech C++, the first native C++ compiler. In 1988, Datalight released C_thru_ROM, which provided embeddedable C functions and C start-up code, allowing programs developed on DOS to run as standalone applications without DOS dependence. In 1989, ROM-DOS 1.0 was released.");

        WordRepository.create(context,"Windows Small Business Server","Windows Server Essentials (formerly Windows Small Business Server or SBS) is an integrated server suite from Microsoft designed for running network infrastructure (both intranet management and Internet access) of small and midsize businesses having no more than 25 users or 50 devices. Application server technologies are tightly integrated to provide and offer management benefits such as integrated setup, enhanced monitoring, Remote Web Workplace, a unified management console, and remote access.");

        WordRepository.create(context,"Revision control","Version control systems (VCS) most commonly run as stand-alone applications, but revision control is also embedded in various types of software such as word processors and spreadsheets, collaborative web docs and in various content management systems, e.g., Wikipedia\'s page history. Revision control allows for the ability to revert a document to a previous revision, which is critical for allowing editors to track each other\'s edits, correct mistakes, and defend against vandalism and spamming in wikis.");

        WordRepository.create(context,"Secure Digital","Secure Digital, officially abbreviated as SD, is a proprietary non-volatile memory card format developed by the SD Card Association (SDA) for use in portable devices.");

        WordRepository.create(context,"SDDL","Security Descriptor Definition Language (SDDL) defines the string format that is used to describe a security descriptor as a text string.");

        WordRepository.create(context,"Secure Digital","Secure Digital, officially abbreviated as SD, is a proprietary non-volatile memory card format developed by the SD Card Association (SDA) for use in portable devices.");

        WordRepository.create(context,"Service Delivery","In 2000/2001, to make ITIL more accessible (and affordable), ITIL Version 2 consolidated the publications into nine logical \"sets\" that grouped related process-guidelines to match different aspects of IT management, applications and services. The Service Management sets (Service Support and Service Delivery) were by far the most widely used, circulated, and understood of the ITIL Version 2 publications.[citation needed]");

        WordRepository.create(context,"FTP over SSH","FTP over SSH is the practice of tunneling a normal FTP session over a Secure Shell connection. Because FTP uses multiple TCP connections (unusual for a TCP/IP protocol that is still in use), it is particularly difficult to tunnel over SSH. With many SSH clients, attempting to set up a tunnel for the control channel (the initial client-to-server connection on port 21) will protect only that channel; when data is transferred, the FTP software at either end sets up new TCP connections (data channels) and thus have no confidentiality or integrity protection.");

        WordRepository.create(context,"Simple File Transfer Protocol","Simple File Transfer Protocol (the first protocol abbreviated SFTP), as defined by RFC 913, was proposed as an (unsecured) file transfer protocol with a level of complexity intermediate between TFTP and FTP. It was never widely accepted on the Internet, and is now assigned Historic status by the IETF. It runs through port 115, and often receives the initialism of SFTP. It has a command set of 11 commands and support three types of data transmission: ASCII, binary and continuous. For systems with a word size that is a multiple of 8 bits, the implementation of binary and continuous is the same. The protocol also supports login with user ID and password, hierarchical folders and file management (including rename, delete, upload, download, download with overwrite, and download with append).");

        WordRepository.create(context,"Supplementary Ideographic Plane","Plane 2, the Supplementary Ideographic Plane (SIP), is used for CJK Ideographs, mostly CJK Unified Ideographs, that were not included in earlier character encoding standards.");

        WordRepository.create(context,"Supplementary Multilingual Plane","Plane 1, the Supplementary Multilingual Plane (SMP), contains historic scripts (except CJK ideographic), and symbols and notation used within certain fields. Scripts include Linear B, Egyptian hieroglyphs, and cuneiform scripts. It also includes English reform orthographies like Shavian and Deseret, and some modern scripts like Osage, Warang Citi, and Adlam. Symbols and notations include historic and modern musical notation; mathematical alphanumerics; Emoji and other pictographic sets; and game symbols for playing cards, Mah Jongg, and dominoes.");

        WordRepository.create(context,"SNTP","Simple Network Time Protocol (SNTP) is a less complex implementation of NTP, using the same protocol but without requiring the storage of state over extended periods of time. It is used in some embedded systems and in applications where full NTP capability is not required.");

        WordRepository.create(context,"Secure Sockets Layer","Transport Layer Security (TLS), and its now-deprecated predecessor, Secure Sockets Layer (SSL), are cryptographic protocols designed to provide communications security over a computer network. Several versions of the protocols find widespread use in applications such as web browsing, email, instant messaging, and voice over IP (VoIP). Websites can use TLS to secure all communications between their servers and web browsers.");

        WordRepository.create(context,"Supplementary Special-purpose Plane","Plane 14 (E in hexadecimal), the Supplementary Special-purpose Plane (SSP), currently contains non-graphical characters. The first block is for special use tag characters. The other block contains glyph variation selectors to indicate an alternate glyph for a character that cannot be determined by context.");

        WordRepository.create(context,"Super Video Graphics Array","Super Video Graphics Array or Ultra Video Graphics Array, almost always abbreviated to Super VGA, Ultra VGA or just SVGA or UVGA is a broad term that covers a wide range of computer display standards.");

        WordRepository.create(context,"Structured VLSI design","Structured VLSI design is a modular methodology originated by Carver Mead and Lynn Conway for saving microchip area by minimizing the interconnect fabrics area. This is obtained by repetitive arrangement of rectangular macro blocks which can be interconnected using wiring by abutment. An example is partitioning the layout of an adder into a row of equal bit slices cells. In complex designs this structuring may be achieved by hierarchical nesting.");

        WordRepository.create(context,"TFTP","Trivial File Transfer Protocol (TFTP) is a simple lockstep File Transfer Protocol which allows a client to get a file from or put a file onto a remote host. One of its primary uses is in the early stages of nodes booting from a local area network. TFTP has been used for this application because it is very simple to implement.");

        WordRepository.create(context,"/var/run","In FHS 3.0, /var/run is replaced by /run; a system should either continue to provide a /var/run directory, or provide a symbolic link from /var/run to /run, for backwards compatibility.");

        WordRepository.create(context,"TeX Users Group","Notable entities in the TeX community include the TeX Users Group, which publishes TUGboat and The PracTeX Journal, covering a wide range of topics in digital typography relevant to TeX. The Deutschsprachige Anwendervereinigung TeX is a large user group in Germany. The TeX Users Group was founded in 1980 for educational and scientific purposes, provides an organization for those who have an interest in typography and font design, and are users of the TeX typesetting system invented by Knuth. The TeX Users Group represents the interests of TeX users worldwide. The TeX Users Group publishes the journal TUGboat three times per year.");

        WordRepository.create(context,"UAAG","The User Agent Accessibility Guideline Working Group develops guidelines, techniques and other documents to promote the accessibility of user agents: browsers and plug-ins. The working group consists mainly of organizations that develop user agents, researchers, and other accessibility experts. UAWG published User Agent Accessibility Guidelines (UAAG) 2.0 in December 2015. Supporting documentation includes: UAAG 2.0 Reference and UAAG Mobile Examples. The working group published User Agent Accessibility Guidelines 1.0 (UAAG 1.0) as a W3C Recommendation in 2002.");

        WordRepository.create(context,"Universal Description, Discovery and Integration","Universal Description, Discovery and Integration (UDDI, pronounced /ˈjʊdiː/) is a platform-independent, Extensible Markup Language protocol that includes a (XML-based) registry by which businesses worldwide can list themselves on the Internet, and a mechanism to register and locate web service applications. UDDI is an open industry initiative, sponsored by the Organization for the Advancement of Structured Information Standards (OASIS), for enabling businesses to publish service listings and discover each other, and to define how the services or software applications interact over the Internet.");

        WordRepository.create(context,"UEFI","The Unified Extensible Firmware Interface (UEFI) is a specification that defines a software interface between an operating system and platform firmware. UEFI replaces the Basic Input/Output System (BIOS) firmware interface originally present in all IBM PC-compatible personal computers, with most UEFI firmware implementations providing legacy support for BIOS services. UEFI can support remote diagnostics and repair of computers, even with no operating system installed.");

        WordRepository.create(context,"Universal Mobile Telecommunications System","The Universal Mobile Telecommunications System (UMTS) is a third generation mobile cellular system for networks based on the GSM standard. Developed and maintained by the 3GPP (3rd Generation Partnership Project), UMTS is a component of the International Telecommunications Union IMT-2000 standard set and compares with the CDMA2000 standard set for networks based on the competing cdmaOne technology. UMTS uses wideband code division multiple access (W-CDMA) radio access technology to offer greater spectral efficiency and bandwidth to mobile network operators.");

        WordRepository.create(context,"Universal Naming Convention","The Microsoft Windows UNC, short for Universal Naming Convention or Uniform Naming Convention, specifies a common syntax to describe the location of a network resource, such as a shared file, directory, or printer. The UNC syntax for Windows systems has the generic form:");

        WordRepository.create(context,"Uniform Resource Locator","A Uniform Resource Locator (URL), colloquially termed a web address, is a reference to a web resource that specifies its location on a computer network and a mechanism for retrieving it. A URL is a specific type of Uniform Resource Identifier (URI), although many people use the two terms interchangeably.[a] URLs occur most commonly to reference web pages (http), but are also used for file transfer (ftp), email (mailto), database access (JDBC), and many other applications.");

        WordRepository.create(context,"/usr","In the original Bell Labs Unix, a two-disk setup was customary, where the first disk contained startup programs, while the second contained users\' files and programs. This second disk was mounted at the empty directory named usr on the first disk, causing the two disks to appear as one filesystem, with the second\'s disks contents viewable at /usr.");

        WordRepository.create(context,"U.S. Robotics","U.S. Robotics Corporation, often called USR, is a company that produces USRobotics computer modems and related products. Its initial marketing was aimed at bulletin board systems, where its high-speed HST protocol made FidoNet transfers much faster, and thus less costly. During the 1990s it became a major consumer brand with its Sportster line. The company had a reputation for high quality and support for the latest communications standards as they emerged, notably in its V.Everything line, released in 1996.");

        WordRepository.create(context,"Unshielded twisted pair","Unshielded twisted pair (UTP) cables are found in many Ethernet networks and telephone systems. For indoor telephone applications, UTP is often grouped into sets of 25 pairs according to a standard 25-pair color code originally developed by AT&T Corporation. A typical subset of these colors (white/blue, blue/white, white/orange, orange/white) shows up in most UTP cables. The cables are typically made with copper wires measured at 22 or 24 American Wire Gauge (AWG), with the colored insulation typically made from an insulator such as polyethylene or FEP and the total package covered in a polyethylene jacket.");

        WordRepository.create(context,"VESA","VESA (/ˈviːsə/), formally known as Video Electronics Standards Association, is a technical standards organization for computer display standards. The organization was incorporated in California in July 1989 and has its office in San Jose, California. It claims a membership of over 225 companies.");

        WordRepository.create(context,"Virtual Hard Disk","VHD (Virtual Hard Disk) is a file format which represents a virtual hard disk drive (HDD). It may contain what is found on a physical HDD, such as disk partitions and a file system, which in turn can contain files and folders. It is typically used as the hard disk of a virtual machine.");

        WordRepository.create(context,"VLSM","CIDR encompasses several concepts. It is based on the variable-length subnet masking (VLSM) technique, which allows the specification of arbitrary-length prefixes. CIDR introduced a new method of representation for IP addresses, now commonly known as CIDR notation, in which an address or routing prefix is written with a suffix indicating the number of bits of the prefix, such as 192.0.2.0/24 for IPv4, and 2001:db8::/32 for IPv6. CIDR introduced an administrative process of allocating address blocks to organizations based on their actual and short-term projected needs. The aggregation of multiple contiguous prefixes resulted in supernets in the larger Internet, which whenever possible are advertised as aggregates, thus reducing the number of entries in the global routing table.");

        WordRepository.create(context,"VNC","In computing, Virtual Network Computing (VNC) is a graphical desktop-sharing system that uses the Remote Frame Buffer protocol (RFB) to remotely control another computer. It transmits the keyboard and mouse events from one computer to another, relaying the graphical-screen updates back in the other direction, over a network.");

        WordRepository.create(context,"Voice over Internet Protocol","Voice over Internet Protocol (VoIP), also called IP telephony, is a methodology and group of technologies for the delivery of voice communications and multimedia sessions over Internet Protocol (IP) networks, such as the Internet. The terms Internet telephony, broadband telephony, and broadband phone service specifically refer to the provisioning of communications services (voice, fax, SMS, voice-messaging) over the public Internet, rather than via the public switched telephone network (PSTN).");

        WordRepository.create(context,"Extensible Stylesheet Language","In computing, the term Extensible Stylesheet Language (XSL) is used to refer to a family of languages used to transform and render XML documents.");

        WordRepository.create(context,"E-learning","Various pedagogical perspectives or learning theories may be considered in designing and interacting with educational technology. E-learning theory examines these approaches. These theoretical perspectives are grouped into three main theoretical schools or philosophical frameworks: behaviorism, cognitivism and constructivism.");

        WordRepository.create(context,"CJKV","In internationalization, CJK is a collective term for the Chinese, Japanese, and Korean languages, all of which include Chinese characters and derivatives (collectively, CJK characters) in their writing systems. Occasionally, Vietnamese is included, making the abbreviation CJKV, since Vietnamese historically used Chinese characters as well. Collectively, the CJKV characters often include hànzì in Chinese, kanji, kana in Japanese, hanja, hangul in Korean, and hán tự or chữ nôm in Vietnamese.");

        WordRepository.create(context,"CNC","Numerical control (NC) (also computer numerical control (CNC)) is the automated control of machining tools (drills, boring tools, lathes) and 3D printers by means of a computer. An NC machine alters a blank piece of material (metal, plastic, wood, ceramic, or composite) to meet precise specifications by following programmed instructions and without a manual operator.");

        WordRepository.create(context,"Common System Interface","The Intel QuickPath Interconnect (QPI) is a point-to-point processor interconnect developed by Intel which replaced the front-side bus (FSB) in Xeon, Itanium, and certain desktop platforms starting in 2008. It increased the scalability and bandwidth available. Prior to the name\'s announcement, Intel referred to it as Common System Interface (CSI). Earlier incarnations were known as Yet Another Protocol (YAP) and YAP+.");

        WordRepository.create(context,"Data Access Objects","Jet Data Access Objects is a general programming interface for database access on Microsoft Windows systems, primarily for Jet and ACE databases.");

        WordRepository.create(context,"Database Management System","In 1970, the University of Michigan began development of the MICRO Information Management System based on D.L. Childs\' Set-Theoretic Data model. MICRO was used to manage very large data sets by the US Department of Labor, the U.S. Environmental Protection Agency, and researchers from the University of Alberta, the University of Michigan, and Wayne State University. It ran on IBM mainframe computers using the Michigan Terminal System. The system remained in production until 1998.");

        WordRepository.create(context,"Double density","Double density (DD or 2D) doubles capacity over SD by replacing FM encoding with an improved line code, such as modified frequency modulation (MFM), modified modified frequency modulation (M²FM), FM/MFM or group coded recording (GCR).");

        WordRepository.create(context,"DDoS","In a distributed denial-of-service attack (DDoS attack), the incoming traffic flooding the victim originates from many different sources. This effectively makes it impossible to stop the attack simply by blocking a single source.");

        WordRepository.create(context,"/dev","In some Unix-like systems, most device files are managed as part of a virtual file system traditionally mounted at /dev, possibly associated with a controlling daemon, which monitors hardware addition and removal at run time, making corresponding changes to the device file system if that\'s not automatically done by the kernel, and possibly invoking scripts in system or user space to handle special device needs. The FreeBSD and DragonFly BSD implementations have named the virtual device file system devfs and the associated daemon devd. Linux primarily uses a user space implementation known as udev, but there are many variants. Darwin, and operating systems such as macOS based on it, have a purely kernel-based device file system.");

        WordRepository.create(context,"Distributed file system","Distributed file systems do not share block level access to the same storage but use a network protocol. These are commonly known as network file systems, even though they are not the only file systems that use the network to send data. Distributed file systems can restrict access to the file system depending on access lists or capabilities on both the servers and the clients, depending on how the protocol is designed.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"PowerBook 540","The PowerBook 500 series was introduced on May 16, 1994, with the high-end active matrix LCD PowerBook 540c and 540, with the passive matrix 520c and 520 soon after. One of its marketing highlights was the promise of a PowerPC upgrade to its CPU and PC Card (PCMCIA) expansion. The introduction of this model came at the time of Apple\'s changeover to the new PowerPC chip from the 68k line of CPUs, and Apple\'s advertising and promise of the PowerPC was the cause of headaches to the company.[citation needed] The strong demand for its ground-breaking design and Apple\'s incorrect market prediction that customers would wait for the fully PowerPC PowerBooks resulted in shortages early on.");

        WordRepository.create(context,"Adobe Flash CS4","In 2008, Adobe released the tenth version of Flash, Adobe Flash CS4. Flash 10 improved animation capabilities within the Flash editor, adding a motion editor panel (similar to Adobe After Effects), inverse kinematics (bones), basic 3D object animation, object-based animation, and other text and graphics features. Flash Player 10 included an in-built 3D engine (without GPU acceleration) that allowed basic object transformations in 3D space (position, rotation, scaling).");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Mozilla Firefox 2.0","On March 22, 2006, the first alpha version of Firefox 2 (Bon Echo Alpha 1) was released. It featured Gecko 1.8.1 for the first time. Mozilla Firefox 2.0.0.x is the final version officially supported on Windows NT 4.0, Windows 98 and Windows ME, although it can run on Windows 95 and Windows NT 3.51 using tweaks. Mac OS X 10.5 support was added October 18, 2007 with version 2.0.0.8.");

        WordRepository.create(context,"Macintosh Performa 600","The Macintosh IIvi (also sold as the Macintosh Performa 600) is a personal computer designed, manufactured, and sold by Apple Computer, Inc. from September 1992 to February 1993. The IIvi was introduced alongside the Macintosh IIvx, using a slower processor (16 MHz vs. 32 MHz) and no floating point unit. The Performa 600 models, meanwhile, are the IIvi with the IIvx\'s 32 MHz CPU. The IIvi was, on some benchmarks, faster than the IIvx. It is the only model in the Macintosh II family to be branded as a Performa.");

        WordRepository.create(context,"Atari 400","The original Atari 400 and 800 models launched with a series of plug-n-play peripherals that used the Atari SIO serial bus system, an early analog of the modern USB.[b] To meet stringent FCC requirements, the early machines were enclosed in a cast aluminum block, which made them physically robust but expensive to produce. Over the following decade, the 400 and 800 were replaced by the XL series, then the XE. The XL and XE are much lighter in construction and less expensive to build, while also having Atari BASIC built-in and reducing the number of joystick ports from 4 to 2. The 130XE, released in 1985, increased the memory to 128K of bank-switched RAM.");

        WordRepository.create(context,"Sun PCi IIPro","The Sun PCi IIPro is currently (as of September 2006[update]), supported by Solaris 7, 8, and 9, but using some tricks can work on Solaris 10. The Sun PCi III and IIIpro are supported by Solaris 9 and 10 (with appropriate updates), and most recent OpenSolaris releases.");

        WordRepository.create(context,"Intel processor","This generational list of Intel processors attempts to present all of Intel\'s processors from the pioneering 4-bit 4004 (1971) to the present high-end offerings, which include the 64-bit Itanium 2 (2002), Intel Core i9, and Xeon E3 and E5 series processors (2015). Concise technical data is given for each product.");

        WordRepository.create(context,"Atari 800","Both computers have four joystick ports, but only a few games such as M.U.L.E. use them all to permit four simultaneous players. Paddle controllers were wired in pairs, and eight players could play Super Breakout. The Atari 400, despite its membrane keyboard and single internal ROM cartridge slot, outsold the full keyboard and RAM expandable Atari 800 by a 2-to-1 margin. Atari intended cartridges in the 800\'s right slot to supplement those in the left, but only a few right-slot cartridges were produced (just one by March 1983), and later computers omitted the slot.");

        WordRepository.create(context,"G450","Upon delivery of the last G450, over 900 GIV/GIV-SP/G450 units had been produced. The last G450 was delivered on 19 January 2018 after 365 deliveries over 12 years, ending a 30-year production run, to be replaced by the G500.");

        WordRepository.create(context,"G80","The 8800 series, codenamed G80, was launched on November 8, 2006 with the release of the GeForce 8800 GTX and GTS for the high-end market. A 320 MB GTS was released on February 12 and the Ultra was released on May 2, 2007. The cards are larger than their predecessors, with the 8800 GTX measuring 10.6 in (~26.9 cm) in length and the 8800 GTS measuring 9 in (~23 cm). Both cards have two dual-link DVI connectors and a HDTV/S-Video out connector. The 8800 GTX requires 2 PCIe power inputs to keep within the PCIe standard, while the GTS requires just one.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");


        WordRepository.create(context,"Mozilla Firefox 2.0","On March 22, 2006, the first alpha version of Firefox 2 (Bon Echo Alpha 1) was released. It featured Gecko 1.8.1 for the first time. Mozilla Firefox 2.0.0.x is the final version officially supported on Windows NT 4.0, Windows 98 and Windows ME, although it can run on Windows 95 and Windows NT 3.51 using tweaks. Mac OS X 10.5 support was added October 18, 2007 with version 2.0.0.8.");

        WordRepository.create(context,"Macintosh Performa 600","The Macintosh IIvi (also sold as the Macintosh Performa 600) is a personal computer designed, manufactured, and sold by Apple Computer, Inc. from September 1992 to February 1993. The IIvi was introduced alongside the Macintosh IIvx, using a slower processor (16 MHz vs. 32 MHz) and no floating point unit. The Performa 600 models, meanwhile, are the IIvi with the IIvx\'s 32 MHz CPU. The IIvi was, on some benchmarks, faster than the IIvx. It is the only model in the Macintosh II family to be branded as a Performa.");

        WordRepository.create(context,"Atari 400","The original Atari 400 and 800 models launched with a series of plug-n-play peripherals that used the Atari SIO serial bus system, an early analog of the modern USB.[b] To meet stringent FCC requirements, the early machines were enclosed in a cast aluminum block, which made them physically robust but expensive to produce. Over the following decade, the 400 and 800 were replaced by the XL series, then the XE. The XL and XE are much lighter in construction and less expensive to build, while also having Atari BASIC built-in and reducing the number of joystick ports from 4 to 2. The 130XE, released in 1985, increased the memory to 128K of bank-switched RAM.");

        WordRepository.create(context,"Sun PCi IIPro","The Sun PCi IIPro is currently (as of September 2006[update]), supported by Solaris 7, 8, and 9, but using some tricks can work on Solaris 10. The Sun PCi III and IIIpro are supported by Solaris 9 and 10 (with appropriate updates), and most recent OpenSolaris releases.");

        WordRepository.create(context,"Intel processor","This generational list of Intel processors attempts to present all of Intel\'s processors from the pioneering 4-bit 4004 (1971) to the present high-end offerings, which include the 64-bit Itanium 2 (2002), Intel Core i9, and Xeon E3 and E5 series processors (2015). Concise technical data is given for each product.");

        WordRepository.create(context,"Atari 800","Both computers have four joystick ports, but only a few games such as M.U.L.E. use them all to permit four simultaneous players. Paddle controllers were wired in pairs, and eight players could play Super Breakout. The Atari 400, despite its membrane keyboard and single internal ROM cartridge slot, outsold the full keyboard and RAM expandable Atari 800 by a 2-to-1 margin. Atari intended cartridges in the 800\'s right slot to supplement those in the left, but only a few right-slot cartridges were produced (just one by March 1983), and later computers omitted the slot.");

        WordRepository.create(context,"G450","Upon delivery of the last G450, over 900 GIV/GIV-SP/G450 units had been produced. The last G450 was delivered on 19 January 2018 after 365 deliveries over 12 years, ending a 30-year production run, to be replaced by the G500.");

        WordRepository.create(context,"G80","The 8800 series, codenamed G80, was launched on November 8, 2006 with the release of the GeForce 8800 GTX and GTS for the high-end market. A 320 MB GTS was released on February 12 and the Ultra was released on May 2, 2007. The cards are larger than their predecessors, with the 8800 GTX measuring 10.6 in (~26.9 cm) in length and the 8800 GTS measuring 9 in (~23 cm). Both cards have two dual-link DVI connectors and a HDTV/S-Video out connector. The 8800 GTX requires 2 PCIe power inputs to keep within the PCIe standard, while the GTS requires just one.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"FB920","Flhorban 920 (FB920) is a synthetic banana hybrid (Musa spp. AAA group) developed as a cultivar of banana naturally resistant to Black and Yellow Sigatoka fungi (Mycosphaerella fijiensis and Mycosphaerella musicola respectively) in an attempt to replace the highly susceptible Cavendish banana. Additionally, FB920 has been shown to improve root resistance to Burrowing nematodes (Radopholus similis).");

        WordRepository.create(context,"Ubuntu 7.04","Ubuntu 7.04 (Feisty Fawn), released on 19 April 2007, was Canonical\'s sixth release of Ubuntu. Ubuntu 7.04\'s support ended on 19 October 2008. Ubuntu 7.04 included several new features, among them a migration assistant to help former Microsoft Windows users transition to Ubuntu, support for Kernel-based Virtual Machine, assisted codec and restricted drivers installation including Adobe Flash, Java, MP3 support, easier installation of Nvidia and ATI drivers, Compiz desktop effects, support for Wi-Fi Protected Access, the addition of Sudoku and chess, a disk usage analyzer (baobab), GNOME Control Center, and Zeroconf support for many devices.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Windows ME","Both the \"Windows Me\" and \"Windows ME\" spellings are used when referring to the operating system, with \"Windows Me\" being used by Microsoft and PC World.");

        WordRepository.create(context,"Ubuntu 7.10","Ubuntu 7.10 (Gutsy Gibbon), released on 18 October 2007, was Canonical\'s seventh release of Ubuntu. Ubuntu 7.10\'s support ended on 18 April 2009. Ubuntu 7.10 included several new features, among them AppArmor security framework, fast desktop search, a Firefox plug-in manager (Ubufox), a graphical configuration tool for X.Org, full NTFS support (read/write) via NTFS-3G, and a revamped printing system with PDF printing by default. Compiz Fusion was enabled as default in Ubuntu 7.10 and Fast user switching was added.");

        WordRepository.create(context,"Ubuntu 18.04 LTS","Joey Sneddon of OMG Ubuntu said of this release, \"this is no normal release of Ubuntu. It\'s potentially the last version of the distribution that will come with the Unity 7 desktop by default. That\'s not a certainty, of course, but we know that Ubuntu will switch to GNOME for Ubuntu 18.04 LTS next year. It\'s reasonable to expect developers to want to kick a few tyres on that switch ahead of time, in the next interim release. A bittersweet release then, Ubuntu 17.04 sees the distro reach the end of the alphabet in codenames, and the end of an era in everything else. Sadly there\'s not an awful lot to say. Unity is, by and large, the same as it is in the 16.04 LTS....Ubuntu 17.04 is an iterative update with modest appeal. While there is little compelling reason for anyone running Ubuntu 16.04 LTS to upgrade (especially for those who opt receive the newer hardware enablement stack) it\'s not an irrelevant release. Ubuntu 16.10 users will want to upgrade to Ubuntu 17.04 for the general around improvements, access to newer apps, and because the truncated support period of these short term releases necessitates it.\"");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Ubuntu 5.04","Ubuntu 5.04 (Hoary Hedgehog), released on 8 April 2005, was Canonical\'s second release of Ubuntu. Ubuntu 5.04\'s support ended on 31 October 2006. Ubuntu 5.04 added many new features including an Update Manager, upgrade notifier, readahead and grepmap, suspend, hibernate and standby support, dynamic frequency scaling for processors, Ubuntu hardware database, Kickstart installation, and APT authentication. Ubuntu 5.04 was the first version that allowed installation from USB devices. Beginning with Ubuntu 5.04, UTF-8 became the default character encoding.");

        WordRepository.create(context,"Ubuntu 8.10","Ubuntu 8.10 (Intrepid Ibex), released on 30 October 2008, was Canonical\'s ninth release of Ubuntu. Support ended on 30 April 2010. Ubuntu 8.10 introduced several new features including improvements to mobile computing and desktop scalability, increased flexibility for Internet connectivity, an Ubuntu Live USB creator and a guest account, which allowed others to use a computer allowing very limited user rights (e.g. accessing the Internet, using software and checking e-mail). The guest account had its own home folder and nothing done on it was stored permanently on the computer\'s hard disk. Intrepid Ibex also included an encrypted private directory for users, the inclusion of Dynamic Kernel Module Support, a tool that allows kernel drivers to be automatically rebuilt when new kernels are released, and support for creating USB flash drive images.");

        WordRepository.create(context,"Ubuntu 9.04","Ubuntu 9.04 (Jaunty Jackalope), released on 23 April 2009, was Canonical\'s tenth release of Ubuntu. Support ended on 23 October 2010. New features included faster boot time, integration of web services and applications into the desktop interface. Because of that, they named it after the mythical jackalope. It was the first release named after a mythical animal, the second being Utopic Unicorn. It had a new usplash screen, a new login screen and also support for both Wacom (hotplugging) and netbooks. It also included a new notification system, Notify OSD, and themes. It marked the first time that all of Ubuntu\'s core development moved to the Bazaar distributed revision control system.");

        WordRepository.create(context,"Android 4.1","Android 4.1 Jelly Bean was first unveiled at the Google I/O developer conference on June 27, 2012, with a focus on \"delightful\" improvements to the platform\'s user interface, along with improvements to Google\'s search experience on the platform (such as Knowledge Graph integration, and the new digital assistant Google Now), the unveiling of the Asus-produced Nexus 7 tablet, and the unveiling of the Nexus Q media player.");

        WordRepository.create(context,"Android 4.4","Android 4.4 \"KitKat\" was officially announced on September 3, 2013. The release was internally codenamed \"Key lime pie\"; John Lagerling, director of Android global partnerships, and his team, decided to drop the name, arguing that \"very few people actually know the taste of a key lime pie\". Aiming for a codename that was \"fun and unexpected\", his team pursued the possibility of naming the release \"KitKat\" instead. Lagerling phoned a representative of Nestlé, who owns the Kit Kat brand and produces the confectionary (outside the United States, where it is produced by The Hershey Company under license), and quickly reached a preliminary deal for a promotional collaboration between the two companies, later finalized in a meeting at Mobile World Congress in February 2013. The partnership was not revealed publicly, or even to other Google employees and Android developers (who otherwise continued to internally refer to the OS as \"KLP\"), until its official announcement in September.");

        WordRepository.create(context,"Intel processor","This generational list of Intel processors attempts to present all of Intel\'s processors from the pioneering 4-bit 4004 (1971) to the present high-end offerings, which include the 64-bit Itanium 2 (2002), Intel Core i9, and Xeon E3 and E5 series processors (2015). Concise technical data is given for each product.");

        WordRepository.create(context,"SCO OpenServer","SCO OpenServer 5, released in 1995, would become SCO\'s primary product and serve as the basis for products like PizzaNet (the first Internet-based food delivery system done in partnership with Pizza Hut) and SCO Global Access, an Internet gateway server based on Open Desktop Lite. Due to its large installed base, SCO OpenServer 5 continues to be actively maintained by SCO with major updates having occurred as recently as April 2009.");

        WordRepository.create(context,"Mandrakelinux","Mandriva Linux (a fusion of the French distribution Mandrakelinux or Mandrake Linux and the Brazilian distribution Conectiva Linux) was a Linux distribution by Mandriva.");

        WordRepository.create(context,"Intel chipset","List of early Intel chipset includes:");

        WordRepository.create(context,"Ubuntu 10.04","The desktop installation of Ubuntu 9.10 replaced Pidgin with Empathy Instant Messenger as its default instant messaging client. The default filesystem is ext4, and the Ubuntu One client, which interfaces with Canonical\'s new online storage system, is installed by default. It introduced Grub 2 beta as default bootloader. It also debuted a new application called the Ubuntu Software Center that unifies package management. Canonical stated their intention for this application to replace Add/Remove Programs (gnome-app-install) in 9.10 and possibly Synaptic, Software Sources, Gdebi and Update Manager in Ubuntu 10.04. Karmic Koala also includes a slideshow during the installation process (through ubiquity-slideshow) that highlights applications and features in Ubuntu.");

        WordRepository.create(context,"Windows Phone 7.5","At the 2011 Mobile World Congress, Steve Ballmer announced a major update to Windows Phone 7 due toward the end of the year, Windows Phone 7.5, codenamed Mango. The new OS would address many of the platform\'s shortcomings, including a mobile version of Internet Explorer 9 that supports the same web standards and graphical capability as the desktop version, multi-tasking of third-party apps, Twitter integration for the People Hub, and Windows Live SkyDrive access. Although the OS internally identifies itself as version 7.1, it is marketed as version 7.5 in all published materials intended for end-users.");

        WordRepository.create(context,"Android 6.0","As of May 2019[update], 16.9% of devices accessing Google Play run Android 6.0. It is the single most popular point release of Android, while the Android Nougat and Oreo major releases, 7.x and 8.x, both have larger install bases.");

        WordRepository.create(context,"Ubuntu 10.10","The naming of Ubuntu 10.10 (Maverick Meerkat) was announced by Mark Shuttleworth on 2 April 2010, along with the release\'s goals of improving the netbook experience and a server focus on hybrid cloud computing. Ubuntu 10.10 was released on 10 October 2010 (10.10.10) at around 10:10 UTC. This is a departure from the traditional schedule of releasing at the end of October to get \"the perfect 10\", and a playful reference to The Hitchhiker\'s Guide to the Galaxy, since, in binary, 101010 is equal to the number 42, the \"Answer to the Ultimate Question of Life, the Universe and Everything\" within the series. It was Canonical\'s 13th release of Ubuntu. New features included the new Unity interface for the Netbook Edition, a new default photo manager, Shotwell, replacing F-Spot, the ability to purchase applications in the Software Center, and an official Ubuntu font used by default.");

        WordRepository.create(context,"Microsoft Shell","By 2002 Microsoft had started to develop a new approach to command line management, including a CLI called Monad (also known as Microsoft Shell or MSH). The ideas behind it were published in August 2002 in a white paper titled Monad Manifesto. Monad was to be a new extensible CLI with a fresh design that would be capable of automating a full range of core administrative tasks. Microsoft first showed off Monad at the Professional Development Conference in Los Angeles in October 2003. A private beta program began a few months later which eventually led to a public beta program.");

        WordRepository.create(context,"Intel processor","This generational list of Intel processors attempts to present all of Intel\'s processors from the pioneering 4-bit 4004 (1971) to the present high-end offerings, which include the 64-bit Itanium 2 (2002), Intel Core i9, and Xeon E3 and E5 series processors (2015). Concise technical data is given for each product.");

        WordRepository.create(context,"Intel processor","This generational list of Intel processors attempts to present all of Intel\'s processors from the pioneering 4-bit 4004 (1971) to the present high-end offerings, which include the 64-bit Itanium 2 (2002), Intel Core i9, and Xeon E3 and E5 series processors (2015). Concise technical data is given for each product.");

        WordRepository.create(context,"Ubuntu 11.04","The naming of Ubuntu 11.04 (Natty Narwhal) was announced on 17 August 2010 by Mark Shuttleworth. Ubuntu 11.04 Natty Narwhal was released on 28 April 2011. It is Canonical\'s 14th release of Ubuntu.");

        WordRepository.create(context,"Sun Java","The source code for Sun\'s implementations of Java (i.e. the de facto reference implementation) has been available for some time, but until recently,[when?] the license terms severely restricted what could be done with it without signing (and generally paying for) a contract with Sun. As such these terms did not satisfy the requirements of either the Open Source Initiative or the Free Software Foundation to be considered open source or free software, and Sun Java was therefore a proprietary platform.");

        WordRepository.create(context,"SiS 730","The SiS 630 and SiS 730 are a family of highly integrated chipsets for Intel (Slot 1/Socket 370) and AMD (Slot A/Socket A) respectively. At the time of release they were unique in that they not only provided VGA, Audio, LAN, IDE and USB functionality on board, but were also in a single-chip solution. At the time of release (1999) most chipsets were composed of physically separate north-bridge and south-bridge chips (technically these still existed in the SiS 630/730 but were contained in a single package). Only later have single-chip solutions become popular in the mainstream, with chipsets such as the nVidia nForce4.");

        WordRepository.create(context,"Ubuntu 11.10","The naming of Ubuntu 11.10 (Oneiric Ocelot) was announced on 7 March 2011 by Mark Shuttleworth. He explained that Oneiric means \"dreamy\". Ubuntu 11.10 was released on schedule on 13 October 2011 and is Canonical\'s 15th release of Ubuntu.");

        WordRepository.create(context,"Palm-Size PC","The Handheld PC was a hardware design for personal digital assistant (PDA) devices running Windows CE. It provides the appointment calendar functions usual for any PDA. The intent of Windows CE was to provide an environment for applications compatible with the Microsoft Windows operating system, on processors better suited to low-power operation in a portable device. Originally announced in 1996, the Handheld PC is distinct from its more recent counterparts such as the Palm-Size PC, Pocket PC, or smartphone in that the specification provides for larger screen sizes as well as a keyboard.");

        WordRepository.create(context,"G1000","The Garmin G1000 is an integrated flight instrument system typically composed of two display units, one serving as a primary flight display, and one as a multi-function display. Manufactured by Garmin, it serves as a replacement for most conventional flight instruments and avionics.");

